INSERT INTO `mqms_voucher` VALUES ('1008', 'DYUC040MQI20190506001', 'DYUC040', '', '已确认', '43592.066574', 'DYUC040RO1904140013', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D210348', 'AT', '4356', 'RA047VJ1011JB2718X3', 'HR1A-0A5-00-R5-R', '43569', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '1、客户进店讲述，车辆行驶中仪表突然提示请检查爆震传感器。', '43591.63037', 'C', 'H', '1、技师根据客户讲述，检查故障现象，确认客户讲述属实。\r\n2、技师使用诊断仪读取整车故障码显示，爆震传感器故障，更换爆震传感器路试，发现故障依旧，根据维修手册指引更换发动机控制单元。\r\n3、更换全新零部件总成测试，故障消失，按照厂家保修条例保存旧件返厂。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43592.066574', '审核索赔单确认关联质量反馈单', '豫C736PX', null, null, null, 'A', '43460', '43485', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
