INSERT INTO `mqms_voucher` VALUES ('1010', 'DZJG020MQI20190712001', 'DZJG020', '', '已确认', '43659.066053', 'DZJG020RO1907120011', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'H013050', 'MT', '8437', '+EGE46000001J6270YVR', 'HR1A-0M5-00-W1-R', '43658', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110404', '显示错误', '客户反映仪表台发动机亮故障灯', '43658.726933', 'C', 'H', '客户反映仪表台发动机亮故障灯\r\n2.经技师检查车辆保险丝正常，车辆外观并无撞击及拆装痕迹，使用专业电脑检测显示爆震传感器故障，查阅维修手册，需更换爆震传感器更换后行驶一段时间故障依旧，再次查阅保修手册需更换发电机控制模块\r\n3.更换发电机控制模块 故障消除', '', '1120003ADU0100', '', '16', '761', '0', '891', null, '43659.066053', '审核索赔单确认关联质量反馈单', '浙G00V51', null, null, null, 'A', '43283', '43329', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1011', 'DYNL030MQI20190715001', 'DYNL030', '', '已确认', '43662.070868', 'DYNL030RO1907030004', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'D050507', 'MT', '99549', '+EGE46000001J2250DEK', 'HR1A-0M5-00-R5-R', '43649', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '客户进店反映发动机故障灯亮。', '43661.855799', 'B', 'H', '1.经维修技师检查故障确实存在。\r\n2.检查发动机电脑板各插线接头无损坏松动现象，用检测仪连接车辆检查读出故障码：B1E7300内部故障及P032500爆震传感器故障。\r\n3.经我店技术人员检查判断为发动机电脑板内部故障导致爆震传感器内部损坏，更换发动机控制单元及爆震传感器故障消除。', '', '1120003ADU0100', '', '16', '834', '0', '975', null, '43662.070868', '审核索赔单确认关联质量反馈单', '云LYS362', null, null, null, 'A', '43157', '43177', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
