INSERT INTO `mqms_voucher` VALUES ('1021', 'DSNA030MQI20190120004', 'DSNA030', '', '已确认', '43489.82066', 'DSNA030RO1901160039', 'C1405A', '', '', '', '', '', 'HR1A-0M8', 'H016983', 'MT', '3576', '+EGE45000001J5100QXG', 'HR1A-0M8-00-W1-R', '43481', '01', '发动机', '0105', '启动性能', '010502', '发动机不能启动（起动机工作）', '1.客户打救援电话反映车在行驶中自动熄火，车无法启动。', '43485.778704', 'B', 'H', '1.我店接到救援电话，维修技师安排拖车进店检查 技师转动钥匙无法启动车辆，检查电瓶线路未见故障。\r\n2.技师用检测仪检测到发动机ECU故障。\r\n3.为其更换发动机电脑后故障消除。', '', '1120003ADU0500', '', '16', '761', '0', '891', null, '43489.82066', '审核索赔单确认关联质量反馈单', '陕AP2M05', null, null, null, 'A', '43294', '43353', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1022', 'DJXA040MQI20190128003', 'DJXA040', '', '已确认', '43493.565799', 'DJXA040RO1901190006', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'C966349', 'AT', '11033', 'RA006VJ1011H830151Q', 'HR1A-0A5-00-W1-R', '43484', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '客户车辆进店检查。', '43493.509468', 'B', 'H', '诊断结果：\r\n1.偶发性自动熄火，进店检查未发现任何故障码，故障也无法重现；\r\n\r\n2.对车辆积碳，发动机搭铁全部处理故障依旧存在；\r\n\r\n3.需索赔申请更换发动机控制单元；\r\n\r\n4.更换后故障暂时排除。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43493.565799', '审核索赔单确认关联质量反馈单', '赣A268B6', null, null, null, 'A', '43021', '43030', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1023', 'DNMD020MQI20190302009', 'DNMD020', '', '已确认', '43527.065243', 'DNMD020RO1903020008', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'D054333', 'MT', '19344', '+EGE46000001J2280E2P', 'HR1A-0M5-00-W1-R', '43526', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '1、客户描述出现故障的时候在行驶状态\r\n2、行驶中仪表发动机故障灯点亮，怠速不稳，排气管冒白烟\r\n3、出现故障的时候车辆在平坦的柏油路面，故障频率第一次出现\r\n4、出现故障后客户没有任何操作', '43526.641898', 'B', 'H', '1、技师打开点火开关检查发现仪表报发动机故障码，故障确实存在\r\n2、用电脑检测发现有四个当前故障码，用试电笔测量4缸喷油嘴控制线路，发现电脑输出的控制线常打铁故障（见附件照片及视频）导致4缸喷油嘴长期喷油，检查相关部位，未发现碰撞及干涉\r\n3、经检查鉴定为排除线路故障，发动机控制单内部故障，更换相关部件，故障消除', '', '1120003ADU0100', '', '16', '761', '0', '891', null, '43527.065243', '审核索赔单确认关联质量反馈单', '蒙DPT911', null, null, null, 'A', '43162', '43185', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1024', 'DJID030MQI20190305001', 'DJID030', '', '已确认', '43529.567986', 'DJID030RO1903040017', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'C964793', 'AT', '21130', 'RA006VJ1011H9010052', 'HR1A-0A5-00-W1-R', '43528', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '客户已进店多次，客户反映早上冷车启动后，正常行驶中，发动机会突然熄火，车况正常，从买车到现在，一共熄火20次，熄火后从新启动能着车。\r\n', '43529.388067', 'B', 'H', '1、观察全车无任何加装或改装的东西;\r\n2、用车辆诊断仪读取故障码，无发现与该故障有关的故障码；\r\n3、测量前舱保险丝和仪表保险丝都良好，前舱电器盒与仪表电器盒后面针脚也都正常，无虚接、脱落；\r\n4：更换发动机电脑', '', '1120003ADU0300', '', '180', '1061', '0', '1400', null, '43529.567986', '审核索赔单确认关联质量反馈单', '★冀D002M2', null, null, null, 'A', '43021', '43028', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1025', 'DSDL010MQI20181004003', 'DSDL010', '', '已确认', '43382.571887', 'DSDL010RO1810040008', 'C1405A', '', '', '', '', '', 'HR1A-0A2', 'D022950', 'AT', '17000', 'RA047VJ1011HC05063F', 'HR1A-0A2-00-W1-R', '43377', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '1、客户到店反应仪表显示请检查排放系统\r\n2、出现故障时车辆在正常路段行驶\r\n3、出现故障后无任何操作', '43377.671574', 'A', 'H', ' 1、电脑诊断仪检测读取故障码为机油控制阀故障，更换之后故障不能排除\r\n 2、按照故障诊断手册指引，更换发动机电脑后故障排除\r\n ', '', '1120003ADU0300', '', '16', '937', '0', '1093', null, '43382.571887', '审核索赔单确认关联质量反馈单', '鲁L7N735', null, null, null, 'A', '43105', '43123', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
