INSERT INTO `mqms_voucher` VALUES ('1034', 'DHNF010MQI20190521001', 'DHNF010', '', '已确认', '43607.06669', 'DHNF010RO1905170001', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'H037323', 'AT', '5855', 'RA047VJ1011J830146Z', 'HR1A-0A5-00-W1-R', '43602', '01', '发动机', '0102', '发动机性能', '010209', '失火', '客户来店反应车辆启动后发动机亮故障灯，车辆异常抖动。\r\n2.', '43606.67912', 'B', 'H', '1.维修技师用电脑检测显示故障码U040181收到的EMS数据无效，P030000单缸或多缸失火\r\n2.判断为发动机控制单元内部异常导致。\r\n3.更换发动机控制单元后故障排除', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43607.06669', '审核索赔单确认关联质量反馈单', '湘FGR888', null, null, null, 'A', '43380', '43411', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1035', 'DLNP010MQI20190611003', 'DLNP010', '', '已确认', '43628.066285', 'DLNP010RO1906040012', 'C1405A', '', '', '', '', '', 'HA1A-0A5', 'H016110', 'AT', '2725', 'JAN28VJ1017J601027S', 'HA1A-0A5-01-W1-R', '43620', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G122', '长亮', '车辆在升级低温性能时，发现无法升级', '43627.69816', 'B', 'H', '1车辆在升级低温性能时，发现无法升级\r\n2.经检查，车辆无法升级低温性能，检查后确认是车辆发动机电脑存在故障，更换后故障排除\r\n3.更换发动机电脑', '', '1120003ADU0400', '', '16', '1260', '0', '1465', null, '43628.066285', '审核索赔单确认关联质量反馈单', '辽PBH955', null, null, null, 'A', '43290', '43574', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1036', 'DYNA040MQI20190302001', 'DYNA040', '', '已确认', '43526.56485', 'DYNA040RO1903010022', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'F299796', 'MT', '2789', '+EGE46000001H91103ZC', 'HR1A-0M5-00-R5-R', '43525', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '该车在使用过程中客户反映，仪表发动机故障灯亮。', '43526.451806', 'B', 'H', '\"1.经检查故障存在仪表发动机故障灯亮。2.用检测仪检测读出故障码P030000 单缸或多缸失火。.检查各线路均正常，检查点火线圈 火花塞正常。判断为发动机电脑版故障导致。\n3.更换发动机控制单元后故障消失。\r\n', '', '1120003ADU0100', '', '56', '822', '0', '1001', null, '43526.56485', '审核索赔单确认关联质量反馈单', '★云AA0R30', null, null, null, 'A', '42991', '43038', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1037', 'DGDF010MQI20190302012', 'DGDF010', '', '已确认', '43527.065243', 'DGDF010RO1902180009', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'D036673', 'MT', '22494', '+EGE46000001J1230AYH', 'HR1A-0M5-00-N1-R', '43514', '10', '电气，进气和排气系统，暖风，空调，仪表', '1003', '仪表、时钟', '100303', '检查指示灯点亮(PGM-FI(MIL)除外)', '车主反映机头故障灯亮，', '43526.713692', 'B', 'H', '1.车主反映机头故障灯亮，车辆重启后还是亮灯。                                    2.车辆进站后经维修师傅用电脑检测为发动机控制单元ECU故障，                        3.需更换发动机控制单元ECU处理。', '', '1120003ADU0100', '', '16', '761', '0', '891', null, '43527.065243', '审核索赔单确认关联质量反馈单', '粤FEL850', null, null, null, 'A', '43129', '43159', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1038', 'DSCA050MQI20190302001', 'DSCA050', '', '已确认', '43527.065243', 'DSCA050RO1903010002', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D135219', 'AT', '2633', 'RA047VJ1011J606085L', 'HR1A-0A5-00-N1-R', '43525', '01', '发动机', '0105', '启动性能', '010502', '发动机不能启动（起动机工作）', '客户来电抱怨发动机抖动异常', '43526.573808', 'B', 'H', '1、我店技师确认故障现象存在，\r\n2、用诊断电脑检查，故障码为P210500；根据维修手册，检查相关保险及线路均正常；检查ER11主继电器无法工作。测量UB-R11-86与UB-R11-30处供电正常；UB-R11-85处无信号来源。\r\n3、对调发动机电脑板后，故障消除；故判断该车发动机电脑板内部故障，需更换。', '', '1120003ASV0800', '', '16', '1260', '0', '1465', null, '43527.065243', '审核索赔单确认关联质量反馈单', '川A9JB84', null, null, null, 'A', '43286', '43416', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
