INSERT INTO `mqms_voucher` VALUES ('1040', 'DZJF030MQI20190417007', 'DZJF030', '', '已确认', '43573.067072', 'DZJF030RO1904160010', 'C1405A', '', '', '', '', '', 'HR1A-0M8', 'D027478', 'MT', '9245', '+EGE45000001J1060A0U', 'HR1A-0M8-00-W1-P', '43571', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100208', '作动不良', '客户反映仪表显示排放故障.', '43572.567465', 'C', 'H', '1.技师用诊断电脑检查发现故障为排气车的液压控制阀.\r\n2.技师对其更换之后故障依旧存在，对其线路检查为导通，对其氧传感器，相位传感器对换之后还是出现故障，最后判断可能是发动机ECU的故障，对其更换之后车辆用车几天故障灯不在出现，应判断为此ECU故障.\r\n3.申请保修更换.', '', '1120003ADU0500', '', '16', '761', '0', '891', null, '43573.067072', '审核索赔单确认关联质量反馈单', '浙FJ5K89', null, null, null, 'A', '43115', '43343', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
