INSERT INTO `mqms_voucher` VALUES ('1042', 'DGDS020MQI20190622009', 'DGDS020', '', '已确认', '43639.065961', 'DGDS020RO1906180002', 'C1405A', '', '', '', '', '', 'FR2A-0A5', 'H030824', 'AT', '10506', 'FAP34VJ1016J906039Z', 'FR2A-0A5-00-W1-2', '43634', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '客户到店反映亮排放系统故障', '43638.687813', 'B', 'F', '1.客户到店反映亮排放系统故障,检查确认故障存在。\r\n2.连接电脑诊断读码有相关故障码输出显示(见正常故障码)\r\n3.按照维修手册检查相关线路导通无异常松动腐蚀现象。\r\n4.排除以上，检查更换发动机电脑路试故障排除，断定为发动机电脑内部故障导致亮排放故障需保修更换处理。\r\n5.更换发动机控制单元故障排除。\r\n', '', '1120003BAF0200', '', '8', '1634', '0', '1887', null, '43639.065961', '审核索赔单确认关联质量反馈单', '桂JE5856', null, null, null, 'A', '43369', '43452', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
