INSERT INTO `mqms_voucher` VALUES ('1046', 'DCQA040MQI20190718005', 'DCQA040', '', '已确认', '43666.459907', 'DCQA040RO1907140018', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'H018426', 'AT', '5213', 'RA047VJ1011J60506ZU', 'HR1A-0A5-00-W1-R', '43660', '08', '肉眼可视缺陷（不包括车体油漆）', '0899', '其他', '089902', '没有合适的代码', '客户来店检查该车排放灯偶尔亮。', '43664.738877', 'B', 'H', '1,客户来店检查该车排放灯偶尔亮。\r\n2,技师检查出故障码，检查氧传感器和其他传感器无异常，经过多次检查，最终诊断是发动机ECU故障，更换后用几天测试，故障不再现。\r\n3，更换发动机控制单元。', '更换发动机控制单元', '1120003ADU0300', '', '16', '761', '0', '891', null, '43666.459907', '审核索赔单确认关联质量反馈单', '渝A972BB', null, null, null, 'A', '43287', '43415', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1047', 'DSCT020MQI20190722003', 'DSCT020', '', '已确认', '43668.567292', 'DSCT020RO1907180005', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'F302886', 'AT', '63195', 'RA006VJ1011H72618AD', 'HR1A-0A5-00-W1-R', '43664', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G127', '失灵', '客户反映该车发动机电脑板有点问题', '43668.456632', 'B', 'H', '经维修技师检查\r\n1，该故障确实存在\r\n2，用电脑读取数据，显示发动机控制单元内部故障，数据丢失，且无人为损坏痕迹\r\n3，更换发动机控制单元故障排除', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43668.567292', '审核索赔单确认关联质量反馈单', '川TAC783', null, null, null, 'A', '42996', '43006', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1048', 'DBJA050MQI20190803004', 'DBJA050', '', '已确认', '43680.568322', 'DBJA050RO1908020002', 'C1405A', '', '', '', '', '', 'HA1A-0A9', 'H039796', 'AT', '1398', 'JAN28VJ1017J80101YF', 'HA1A-0A9-02-W1-R', '43679', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G999', '其他', '电脑检测有故障码无法删除', '43680.497153', 'C', 'H', '1.经技师检查确认故障属实\r\n2.用检测仪检测出现，故障码P150200（EBS的LIN报文接收回应时长超限），P150000（EBS的LIN报文帧错误），P155100（DC/DC的LIN报文校验错误），故判断为发动机控制单元故障\r\n3.更换发动机控制单元，故障排除，客户满意', '', '1120003ADU0400', '', '16', '1260', '0', '1465', null, '43680.568322', '审核索赔单确认关联质量反馈单', '京YC8823', null, null, null, 'A', '43354', '43644', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1049', 'DSDN010MQI20190818006', 'DSDN010', '', '已确认', '43696.067315', 'DSDN010RO1908180008', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D259254', 'AT', '1700', 'RA047VJ1011K3210VH4', 'HR1A-0A5-00-W1-R', '43695', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100202', '工作不正常或完全不工作', '客户反映使用过程中发动机故障灯亮，要求解决问题。', '43695.671852', 'B', 'H', '1.客户进店后经维修技师检查发现故障确实存在。\r\n2.检查线路与组合仪表均正常，用电脑读取故障码，有发动机电脑故障。更换后故障消失。\r\n3.零部件无碰撞痕迹，属于质量问题，无法修复，需要更换发动机控制单元总成。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43696.067315', '审核索赔单确认关联质量反馈单', '鲁NQ93Y9', null, null, null, 'A', '43583', '43631', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
