INSERT INTO `mqms_voucher` VALUES ('1053', 'DSXA030MQI20190829002', 'DSXA030', '', '已确认', '43707.067049', 'DSXA030RO1908280015', 'C1405A', '', '', '', '', '', 'FR2A-0M8', 'F480864', 'MT', '19228', '+EGE45000001J3200GWR', 'FR2A-0M8-00-W1-2', '43705', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户进站反映车辆行驶中故障灯亮 ，驾驶没有不良感觉', '43706.646343', 'B', 'F', '1、经维修技师电脑读取故障码，发现有各传感器供电电压故障；\r\n2、检测插头端电压正常，发动机电脑到传感器线路正常，客户反映为偶发现象；\r\n3更换发动机电脑板后试车一个月故障消失。', '', '1120003BAF0800', '', '8', '1634', '0', '1887', null, '43707.067049', '审核索赔单确认关联质量反馈单', '晋D2653L', null, null, null, 'A', '43185', '43240', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1054', 'DGDA100MQI20190826001', 'DGDA100', '', '已确认', '43707.657338', 'DGDA100RO1908260002', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D069717', 'AT', '27781', 'RA047VJ1011J2130J4R', 'HR1A-0A5-00-N1-R', '43703', '10', '电气，进气和排气系统，暖风，空调，仪表', '1003', '仪表、时钟', '100304', '作动不良', '客户到店反映车子出现过几次有电但是着不了车。', '43703.475602', 'B', 'H', '1.实车确认故障存在。\r\n2.检查蓄电池寿命正常，电量充足，检查发动机线束一切良好，车头并无撞击或人为拆装过的痕迹，用电脑检测读的故障码“ECM处理器故障”，车辆在店内试车没有出现故障，客户表示已经出现了三次这种情况，应该属于偶发性故障，通过检测判断应该是发动机控制单元故障导致。\r\n3.更换新的零件后故障排除，没有再现。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43707.657338', '审核索赔单确认关联质量反馈单', '粤NHL626', null, null, null, 'A', '43183', '43204', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
