INSERT INTO `mqms_voucher` VALUES ('1064', 'DGDS080MQI20191016006', 'DGDS080', '', '已确认', '43759.577755', 'DGDS080RO1910150006', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'H010062', 'AT', '15306', 'RA047VJ1011J50906X4', 'HR1A-0A5-00-W1-R', '43753', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户反映：早上着车后仪表亮很多故障灯，偶发性的已经出现过三四次了', '43756.433507', 'C', 'H', '技师检测：\r\n    1：确认故障存在；\r\n    2：经技师在店测试两天后故障重现，仪表报多个故障，技师用诊断电脑读取整车雾障码，当前故障码为“B110017\"蓄电池供电是压高于阈值，无法清除，近故障码指引排查蓄电池，车身控制模块各连接插头是否存在接触不良，均为正常。测试发电后发现电压会偶发性偏高，技师现同车型测无此现象，技师对此现象排查发电机，发动机控制单元，确认为发动机控制单元内部故障，技师与同车型对调该件多次测试故障未在现，技师判断为发动机控制单元内部故障。\r\n    3：更换新件，故障消除，属质ᒻ୔\0愴ᒬ', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43759.577755', '审核索赔单确认关联质量反馈单', '粤S0B1G2', null, null, null, 'A', '43263', '43280', '阀门坏', null, null, '151', 'AT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
