INSERT INTO `mqms_voucher` VALUES ('1074', 'DNMD010MQI20181130003', 'DNMD010', '', '已确认', '43434.856551', 'DNMD010RO1811290021', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D046411', 'AT', '4747', 'RA047VJ1011J10800BK', 'HR1A-0A5-00-W1-R', '43433', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '检查车辆仪表发动机灯亮', '43434.671389', 'B', 'H', '1.电脑检测有故障码：ECM与电子驻车控制模块通讯丢失，对调电子驻车控制模块故障依旧，根据维修手册及维修技师判断鉴定为发动机控制单元故障。\r\n2.更换新的发动机控制单元故障解除。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43434.856551', '审核索赔单确认关联质量反馈单', '蒙D1967R', null, null, null, 'A', '43141', '43171', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
