INSERT INTO `mqms_voucher` VALUES ('1078', 'DSXA040MQI20190223001', 'DSXA040', '', '已确认', '43520.065625', 'DSXA040RO1902220006', 'C1405A', '', '', '', '', '', 'FR2A-0A5', 'H010913', 'AT', '3475', 'FAP34VJ1016J60600XW', 'FR2A-0A5-00-W1-2', '43518', '01', '发动机', '0102', '发动机性能', '010212', '发动机转速不能升高', '1.客户发现发动机故障灯亮，车速提不起来.\r\n2.客户第一时间到店检查.\r\n3.客户行驶在平整的柏油路上.', '43519.654687', 'B', 'F', '1.车间技师检查发现发动机故障灯亮.\r\n2.车间技师检查确认没有碰撞的痕迹.\r\n3.车间技师电脑检测并消除故障码，试车发现发动机故障灯还亮，车速不能提升，车间技师查看维修手册发现节气门、加速踏板受发动机控制单元控制，车间技师拿此车的发动机控制单元装在同类型的车上，发现故障码还存在，车间技师建议更换发动机控制单元.\r\n4.更换新的发动机控制单元后，故障码消失，车速正常.客户满意.', '', '1120003BAF0200', '', '8', '1634', '0', '1887', null, '43520.065625', '审核索赔单确认关联质量反馈单', '晋A155TZ', null, null, null, 'A', '43278', '43342', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1079', 'DGDC040MQI20190430009', 'DGDC040', '', '已确认', '43586.067037', 'DGDC040RO1904290006', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D035405', 'AT', '21957', 'RA047VJ1011HC190STX', 'HR1A-0A5-00-W1-R', '43584', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户反映车辆行驶时挫车明显。\r\n', '43585.595093', 'B', 'H', '经维修技师检查：\r\n1、连接电脑检查查看具体的数据情况；\r\n2、电脑检查出来有多个故障码；\r\n3、当前故障码（详细照片）；\r\n4、更换发动机控制单元ECU，故障排除。\r\n', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43586.067037', '审核索赔单确认关联质量反馈单', '粤C83C09', null, null, null, 'A', '43126', '43130', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1080', 'DLNA050MQI20190512001', 'DLNA050', '', '已确认', '43598.067072', 'DLNA050RO1905090002', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D070926', 'AT', '11864', 'RA047VJ1011J2210Z22', 'HR1A-0A5-00-W1-R', '43594', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户进店反馈车辆发动机控制单元故障灯亮', '43597.634491', 'B', 'H', '1、客户进店反馈车辆发动机控制单元故障灯亮。\r\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n2、技师确认故障情况属实，进一步检查车辆发现发动机控制单元不能工作，无碰撞痕迹，判断主因件为发动机控制单元。\r\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n3、更换发动机控制单元故障排除。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43598.067072', '审核索赔单确认关联质量反馈单', '辽A5M83P', null, null, null, 'A', '43184', '43297', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1081', 'DYUG030MQI20190519016', 'DYUG030', '', '已确认', '43605.065764', 'DYUG030RO1905180007', 'C1405A', '', '', '', '', '', 'FR2A-0M5', 'D084132', 'MT', '23806', '+EGE45000001J4120LE5', 'FR2A-0M5-00-W1-2', '43603', '01', '发动机', '0102', '发动机性能', '010225', '发动机自动熄火（可以再启动）', '客户反应发动机怠速自动熄火', '43604.612245', 'B', 'F', '1.我店技师先是用电脑检查无故障\r\n2..技师检查汽油滤，节气门均无异常，车内无任何加装现象，点烟器处没有外接电源\r\n3.经技师检查发动机控制单元需更换\r\n4.查阅简历在质保期内', '', '1120003BAF0800', '', '152', '2157', '0', '2633', null, '43605.065764', '审核索赔单确认关联质量反馈单', '豫GD19M8', null, null, null, 'A', '43206', '43267', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
