INSERT INTO `mqms_voucher` VALUES ('1083', 'DYNA070MQI20190612001', 'DYNA070', '', '已确认', '43629.06603', 'DYNA070RO1906110012', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D048867', 'AT', '9596', 'RA047VJ1011J1160EWD', 'HR1A-0A5-00-W1-R', '43627', '01', '发动机', '0104', '故障（功能，作动不良）', '010402', '检查指示灯点亮(PGM-FI(MIL)除外)', '客户反应车辆发动机故障灯点亮。', '43628.680475', 'B', 'H', '经检查故障存在，此车发动机故障灯亮，已对调过点火线圈，更换过火花塞，故障依然存在，之前维修过两次，更换了两次爆震传感器，发动机线束也对调是试过，故障依然存在，维修技师判断是发动机控制单元故障导致，更换后故障也消失了。', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43629.06603', '审核索赔单确认关联质量反馈单', '云A6D80C', null, null, null, 'A', '43155', '43191', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
