INSERT INTO `mqms_voucher` VALUES ('1085', 'DGZA030MQI20190316005', 'DGZA030', '', '已确认', '43541.06603', 'DGZA030RO1903080010', 'C1405A', '', '', '', '', '', 'HR1A-0M8', 'F325620', 'MT', '15291', '+EGE45000001HA16061B', 'HR1A-0M8-00-Y3-R', '43532', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '1、客户来电反映该车行驶半路熄火后打不着火，发动机故障灯亮。', '43540.676493', 'B', 'H', '1、客户来电反映该车行驶半路熄火后打不着火，发动机故障灯亮。\r\n2，维修技师出门救援反馈，故障属实，将车拖回店内检查，检查电源正常，各个传感器没有损坏，用电脑读出故障码（U040181 收到的EMS数据无效）、（U010087 与EMS丢失通信）、（U044781 收到的网关数据无效）、初步怀疑是发动机控制单元内部故障导致，拆卸他车对调试车，故障消除，检查相关部位无碰撞及车身干涉，经检查鉴定为发动机控制单元内部故障失去信号导致，需要更换发动机控制单元。\r\n3，更换发动机控制单元。\r\n4，更换新件后故障消除ᒻ', '', '1120003ADU0500', '', '16', '761', '0', '891', null, '43541.06603', '审核索赔单确认关联质量反馈单', '贵FVH122', null, null, null, 'A', '43032', '43037', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1086', 'DSCA030MQI20190323001', 'DSCA030', '', '已确认', '43548.066007', 'DSCA030RO1903120018', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'H017600', 'MT', '4152', '+EGE46000001J6120WKA', 'HR1A-0M5-00-W1-R', '43536', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '排放故障灯亮', '43547.589931', 'B', 'H', '1.技师确认故障现象见附件\r\n2.技师读取故障代码与防盗器认证失败故障\r\n3.检查线路正常\r\n4.更换发动机电脑故障消除', '', '1120003ADU0100', '', '256', '7995', '0', '9450', null, '43548.066007', '审核索赔单确认关联质量反馈单', '川AE0K43', null, null, null, 'A', '43284', '43389', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1087', 'DGDS030MQI20190331009', 'DGDS030', '', '已确认', '43556.066065', 'DGDS030RO1903310012', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'F299826', 'MT', '12054', '+EGE46000001H90803XE', 'HR1A-0M5-00-R5-R', '43555', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100228', '不能锁', '客户反映：钥匙经常锁不了车，按没反应，现在都是用钥匙锁车的。', '43555.753368', 'C', 'H', '我店技师检测：\r\n  1：技师现场检测确认故障存在，钥匙离车辆超过3米就无法正常开、锁车辆。\r\n  2：检测各线路.各控制器均无发现异常。\r\n  3：用解码仪读取无故障码，技师初步判断为BCM故障导致。\r\n  5:更换新件故障消失，属质量问题，需做保修处理。', '', '8045006ADU0002', '', '144', '1747', '0', '2153', null, '43556.066065', '审核索赔单确认关联质量反馈单', '粤S2P0K9', null, null, null, 'A', '42991', '43042', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
