INSERT INTO `mqms_voucher` VALUES ('1091', 'DSCA040MQI20180315001', 'DSCA040', '', '已确认', '43180.572338', 'DSCA040RO1803150008', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'D022899', 'MT', '2314', '+EGE46000001J10409S0', 'HR1A-0M5-00-W1-R', '43174', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '客户到店检查车辆发动机故障灯点亮，高速行驶中车辆挂空挡转速超过3000转。', '43174.730648', 'C', 'H', '1.经检查确认，车辆发动机故障灯点亮，使用诊断仪检查故障为P008000,怀疑车辆相位传感器故障，与试驾车对换车辆相位传感器，故障依旧。\r\n2.使用诊断仪清除故障码，再次试车故障再现，怀疑发动机控制单元故障导致故障灯点亮。\r\n3.更换发动机控制单元后故障排除。', '', '1120003ADU0100', '', '16', '761', '0', '777', null, '43180.572338', '审核索赔单确认关联质量反馈单', '川A31V3M', null, null, null, 'A', '43106', '43125.740579', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1092', 'DYNL030MQI20180530009', 'DYNL030', '', '已确认', '43250.698275', 'DYNL030RO1805060009', 'C1405A', '', '', '', '', '', 'HR1A-0M5', 'D022905', 'MT', '5871', '+EGE46000001J10409UY', 'HR1A-0M5-00-W1-R', '43226', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户反映该车发动机故障灯常亮。', '43250.587488', 'C', 'H', '1.客户反映该车发动机故障灯常亮。经检查故障存在。\r\n2.检查点火项圈和火花塞，无烧蚀工作正常。查看维修履历燃油滤清器和空气滤清器在规定期限正常更换、清洗。变速箱油和机油无变质。\r\n3.用解码仪检测显示“ECM与电子驻车控制模块通讯丢失”检查车身控制模块工作正常无故障。\r\n4.经多次检查判断是发动机控制单元内部故障导致故障灯常亮，需更换发动机控制单元。\r\n5.更换后故障排除。', '', '1120003ADU0100', '', '152', '1472', '0', '1738', null, '43250.698275', '审核索赔单确认关联质量反馈单', '云M06H06', null, null, null, 'A', '43105', '43130.71265', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
