INSERT INTO `mqms_voucher` VALUES ('1095', 'DYUE020MQI20180611011', 'DYUE020', '', '已确认', '43263.065556', 'DYUE020RO1806110003', 'C1405A', '', '', '', '', '', 'HR1A-0A5', 'D077868', 'AT', '1619', 'RA047VJ1011J223137V', 'HR1A-0A5-00-W1-R', '43262', '01', '发动机', '0105', '启动性能', '010502', '发动机不能启动（起动机工作）', '用户反映车辆行驶中经常熄火，重新起动后故障灯亮', '43262.765671', 'B', 'H', '1.用户反映车辆行驶中经常熄火，重新起动后故障灯亮\r\n2.经检查无外力作用，检查线路、保险、继电器、发电机、起动机均正常\r\n3.用诊断仪检测故障码为：P081A00（起动机控制电路对地短路或开路）、P210500（发动机强制停机）、P210600（限制发动机对加速踏板的响应）、P134100（进气CCP目标轮诊断故障）、P060C00（ECM处理器故障）确认是因发动机控制单元故障\r\n4.更换发动机控制单元路试一段时间，一切正常，故障排除', '', '1120003ADU0300', '', '16', '761', '0', '891', null, '43263.065556', '审核索赔单确认关联质量反馈单', '豫E03P69', null, null, null, 'A', '43192', '43215.761343', '阀门坏', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
