INSERT INTO `mqms_voucher` VALUES ('1204', 'DGDF010MQI20180912003', 'DGDF010', '', '已确认', '43372.167188', 'DGDF010RO1809110011', 'C3230A', '', '', '', '', '', 'HR1A-0A5', 'D030677', 'AT', '19357', 'RA047VJ1011HC110DA3', 'HR1A-0A5-00-W1-R', '43354', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '1、客户反映车辆正常使用过程中发动机故障灯常亮且伴有发动机抖动的现象。打不着火需要救援拖车。', '43355.722384', 'B', 'H', '1、到店后由维修技师检查确认故障的确存在。\r\n2、使用PC检测仪进行故障码读取，当前故障码为：“P030022-发生导致催化器损坏的多缸失火、P030322-发生导致催化器损坏的二缸失火”，尝试清除故障码后路试车辆，故障情况依旧发生行驶过程中发动机抖动，故障码点亮等故障，回站后更换二缸点火线圈后再次进行路试车辆，故障消失。\r\n3、判定为二缸点火线圈故障损坏，需更换处理。', '', '10130332010000', '', '24', '113', '0', '153', null, '43372.167188', '审核索赔单确认关联质量反馈单', '粤FFH772', null, null, null, 'A', '43115', '43126', '整理2', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
