INSERT INTO `mqms_voucher` VALUES ('1221', 'DYNE010MQI20190628003', 'DYNE010', '', '已确认', '43644.728137', 'DYNE010RO1906190004', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'H011400', 'MT', '11908', '+EGE46000001J5290TN9', 'HR1A-0M5-00-W1-R', '43635', '10', '电气，进气和排气系统，暖风，空调，仪表', '1004', '噪音，振动', '100401', '异响', '客户到店反馈车辆加不起油', '43644.623692', 'B', 'H', '1.经检查故障存在，仪表故障灯点亮，加不起油。2.检查节气门插头无松动现象，各线路均正常，电瓶电压正常。拆件附件检查无明显损坏现象，用检测仪检测读出故障码 P012128 电子节气门位置传感器1信号不合理。判断为节气门内部故障导致。3.更换电子节气门体后故障消失。', '', '10130361310000', '', '32', '494', '0', '600', null, '43644.728137', '审核索赔单确认关联质量反馈单', '云E64748', null, null, null, 'A', '43265', '43353', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
