INSERT INTO `mqms_voucher` VALUES ('1224', 'DLNG010MQI20190221001', 'DLNG010', '', '已确认', '43517.565405', 'DLNG010RO1902210001', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'D002052', 'MT', '19311', '+EGE46000001HB3008FB', 'HR1A-0M5-00-W1-R', '43517', '05', '制动', '0502', '故障（功能，作动不良）', '050205', '作动不良', '客户来店反应车辆在行驶后停下，踩刹车车辆会向前运，然后熄火。', '43517.483866', 'A', 'H', '1、客户来店反应车辆在行驶后停下，踩刹车车辆会向前运，然后熄火。\r\n2,、根据客户描述，我店技师对车辆进行检查，情况属实，我店对车辆故障为题进行试验，发现车辆状况为偶发状况，检查车辆因节气门内部故障而导致，检查外观无异常，无损坏，建议更换。\r\n3、更换电子节气门体后车辆故障消失。', '', '10130361310000', '', '32', '494', '0', '600', null, '43517.565405', '审核索赔单确认关联质量反馈单', '辽G0A700', null, null, null, 'A', '43070', '43077', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
