INSERT INTO `mqms_voucher` VALUES ('1226', 'DJXE010MQI20190527011', 'DJXE010', '', '已确认', '43612.56669', 'DJXE010RO1905220001', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'F299825', 'MT', '12937', '+EGE46000001H90803X6', 'HR1A-0M5-00-R5-R', '43607', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G122', '长亮', '客户来店反映车辆无法加速，故障灯点亮。', '43612.441331', 'A', 'H', '根据客户描述，技师对车辆进行电脑检测，发现电子节气门体故障，更换电子节气门体故障排除.', '', '10130361310000', '', '32', '494', '0', '600', null, '43612.56669', '审核索赔单确认关联质量反馈单', '赣L87P88', null, null, null, 'A', '42991', '43005', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1227', 'DJIB040MQI20190830021', 'DJIB040', '', '已确认', '43708.066377', 'DJIB040RO1908180050', 'C4012A', '', '', '', '', '', 'HR1A-0A5', 'C982413', 'AT', '46847', 'RA047VJ1011H9251353', 'HR1A-0A5-00-W1-R', '43695', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100202', '工作不正常或完全不工作', '用户反应怠速发动机抖动', '43707.866759', 'B', 'H', '1、用户反应怠速发动机抖动\r\n2、到店检查发现故障确实存在，经我店技师拆解检查火花塞和喷油嘴无异常，电脑检查节气门存在故障码，拆解清洗重新安装试车故障还是存在，确定是节气门体故障\r\n3、更换新件故障消失', '', '10130361310000', '', '32', '494', '0', '600', null, '43708.066377', '审核索赔单确认关联质量反馈单', '冀B1DR07', null, null, null, 'A', '43047', '43057', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1228', 'DGDS020MQI20171125001', 'DGDS020', '', '已确认', '43066.636898', 'DGDS020RO1711240008', 'C4012A', '', '', '', '', '', 'HR1A-0A5', 'C982291', 'AT', '9', 'RA006VJ1011H53118DV', 'HR1A-0A5-00-N1-R', '43063', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100216', '异响', '新车客户来验车时反应发动机有异响', '43064.633565', 'B', 'H', '1.新车客户来验车时反应发动机有尖锐的声音，检查确认声音存在（见故障录像）\r\n2.根据客户反应的声音技师检查发现为节气门怠速阀工作声音，告诉客户没问题放心用车，但用户不同意。\r\n3.对比同款车故障车怠速阀工作声音较大。\r\n4.替换新的节气门体测试确认确实工作声音减少或无，与客户确认声音客户无疑问交车。\r\n5.更换电子节气门体故障排除。\r\n', '', '10130361310000', '', '32', '494', '0', '600', null, '43066.636898', '审核索赔单确认关联质量反馈单', '1006049', null, null, null, 'A', '43047', '43058.673947', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1229', 'DJIF020MQI20180423005', 'DJIF020', '', '已确认', '43213.686481', 'DJIF020RO1804210068', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'D066664', 'MT', '99', '+EGE46000001J3120FT4', 'HR1A-0M5-00-W1-R', '43211', '03', '悬挂，车轮，传动轴', '0301', '噪音，振动', '030101', '异响', '客户进站反应车辆正常行驶使用中，发动机前部“翁儿翁儿”异响明显。', '43213.662986', 'B', 'H', '1、经过维修技师的检查确认为异响声确实存在。\r\n2、维修技师仔细检查听诊确认为前部“翁儿翁儿”异响，对比其它同款车辆确认为此车辆为节气门体发出的异响声。倒换新的后异响消除。\r\n3、更换电子节气门体。', '更换电子节气门体', '10130361310000', '', '32', '494', '0', '600', null, '43213.686481', '审核索赔单确认关联质量反馈单', '', null, null, null, 'A', '43178', '43203.705255', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1230', 'DGDE060MQI20180530004', 'DGDE060', '', '已确认', '43251.565243', 'DGDE060RO1805290020', 'C4012A', '', '', '', '', '', 'HR1A-0A5', 'D033511', 'AT', '3676', 'RA047VJ1011HC220XWS', 'HR1A-0A5-00-R5-R', '43249', '01', '发动机', '0103', '噪音，振动', '010303', '作动声音大', '车主到店反映行驶时听到前舱发出异响声。', '43251.419155', 'C', 'H', '1.师傅与车主去试车确实有异响声在前舱发出，师傅着车检查停顿时异响声也有，车辆熄火时异响声就消失，师傅着车打开前舱使用听诊器逐一排除，异响声很明显的在电子节气门里发出。根据师傅判断异响声由电子节气门内部故障。\r\n2.师傅检查电子节气门没有拆装及碰撞痕迹。\r\n3.师傅判断需要更换电子节气门。\r\n4.更换过电子节气门异响声消失使用正常。', '', '10130361310000', '', '32', '494', '0', '600', null, '43251.565243', '审核索赔单确认关联质量反馈单', '粤X5B607', null, null, null, 'A', '43123', '43129.724236', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1231', 'DSXH010MQI20180821001', 'DSXH010', '', '已确认', '43333.565', 'DSXH010RO1808200010', 'C4012A', '', '', '', '', '', 'HR1A-0A5', 'D062167', 'AT', '7561', 'RA047VJ1011J2160S0E', 'HR1A-0A5-00-W1-R', '43332', '01', '发动机', '0103', '噪音，振动', '010306', '嗡嗡声', '客户到店反应车辆行驶中动力不足，并且带有异响。', '', 'B', 'H', '1、经机修技师检查故障确实存在。\r\n2、机修技师检查前机舱，用听诊器确定异响从电子节气门中传出。\r\n3、更换电子节气门后，故障排除。', '', '10130361310000', '', '32', '494', '0', '600', null, '43333.565', '审核索赔单确认关联质量反馈单', '晋HBT526', null, null, null, 'A', '43173', '43186', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1232', 'DYNA060MQI20180831006', 'DYNA060', '', '已确认', '43344.065069', 'DYNA060RO1808270005', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'D002079', 'MT', '1905', '+EGE46000001HB24080M', 'HR1A-0M5-00-R5-R', '43339', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100216', '异响', '1、用户进站反映加速时发动机有异响。\r\n2、怠速工况无异响。\r\n3、要求排查。', '43343.882442', 'C', 'H', '1、维修技师检查发现加油门是发动机有异响。\r\n2、检查异响来源于发动机节气门体，有漏气声。\r\n3、节气门密封不严导致异响，是质量问题。\r\n4、更换节气门体。', '', '10130361310000', '', '32', '494', '0', '600', null, '43344.065069', '审核索赔单确认关联质量反馈单', '云A8V9H8', null, null, null, 'A', '43069', '43294', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1233', 'DZJF020MQI20181018001', 'DZJF020', '', '已确认', '43392.066447', 'DZJF020RO1810180002', 'C4012A', '', '', '', '', '', 'HR1A-0M5', 'D083159', 'MT', '1792', '+EGE46000001J4100L2R', 'HR1A-0M5-00-W1-R', '43391', '01', '发动机', '0103', '噪音，振动', '010302', '异响', '客户进店反应车辆行驶时发动机舱内有异响', '43391.703657', 'B', 'H', '1、维修技师启动车辆进行试车，发现发动机舱内有异响，确认故障现象  2、维修技师对发动机舱仔细检查，发现异响是由电子节气门体发出，且无人为损坏迹象   3、更换电子节气门体，故障消失', '', '10130361310000', '', '256', '774', '0', '1146', null, '43392.066447', '审核索赔单确认关联质量反馈单', '浙FC2N95', null, null, null, 'A', '43201', '43328', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1234', 'DGDK010MQI20181019021', 'DGDK010', '', '已确认', '43393.066991', 'DGDK010RO1810190002', 'C4012A', '', '', '', '', '', 'HR1A-0A5', 'D001436', 'AT', '6630', 'RA047VJ1011HA2615AD', 'HR1A-0A5-00-W1-R', '43392', '01', '发动机', '0103', '噪音，振动', '010302', '异响', '客户到店反映发动机异响。', '43392.707454', 'C', 'H', '1.经检查，发现异响位于电子节气门阀体处，进一步用听诊器检查，确定异响来自于电子节气门阀体马达。判断电子节气门由于内部故障，导致异响声出现。\r\n2.经更换电子节气门后，试车正常，异响声消失。', '', '10130361310000', '', '52', '494', '0', '620', null, '43393.066991', '审核索赔单确认关联质量反馈单', '粤K15P87', null, null, null, 'A', '43068', '43080', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
