INSERT INTO `mqms_voucher` VALUES ('1252', 'DSCT020MQI20180115001', 'DSCT020', '', '已确认', '43117.071528', 'DSCT020RO1801120003', 'C3241B', '', '', '', '', '', 'HR1A-0M8', 'F337654', 'MT', '3128', '+EGE45000001HA180640', 'HR1A-0M8-00-W1-R', '43112', '01', '发动机', '0102', '发动机性能', '010209', '失火', '客户反映该车在行驶及怠速时有明显的抖动.', '43115.567419', 'B', 'H', '经维修技师检查：\r\n1.检查分缸线未发现故障。\r\n2.检查火花塞发现1缸火花塞陶瓷有裂痕。\r\n3.更换1缸火花塞，故障排除。', '', '10130351820000', '', '16', '68', '0', '94', null, '43117.071528', '审核索赔单确认关联质量反馈单', '湘KHJ786', null, null, null, 'A', '43032', '43045.629086', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1253', 'DLNF010MQI20180325002', 'DLNF010', '', '已确认', '43185.070093', 'DLNF010RO1803180003', 'C3241B', '', '', '', '', '', 'HR1A-0A5', 'F399242', 'AT', '3691', 'RA047VJ1011HB301EQU', 'HR1A-0A5-00-W1-R', '43177', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '客户进店反映车辆发动机异常抖动。', '43184.61897', 'B', 'H', '1.技师检查发现车辆发动机确实异常抖动。\r\n\r\n2.技师连接诊断仪并未有故障码，检查发现是第二缸火花塞工作异常，需要更换零件。\r\n\r\n3.更换火花塞后，车辆故障排除。', '', '10130351820000', '', '16', '68', '0', '94', null, '43185.070093', '审核索赔单确认关联质量反馈单', '辽FGK025', null, null, null, 'A', '43096', '43128.579375', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1254', 'DLNP010MQI20180703010', 'DLNP010', '', '已确认', '43285.064398', 'DLNP010RO1806190008', 'A1045A', '', '', '', '', '', 'HR1A-0A5', 'C959675', 'AT', '5385', 'RA006VJ1011H8260ZEW', 'HR1A-0A5-00-W1-R', '43270', '01', '发动机', '0103', '噪音，振动', '010307', '振动', '车辆行驶时出现抖动现象', '43284.680625', 'B', 'H', '1.车辆行驶时出现抖动现象\r\n2.经检查，确认该故障存在，检查火花塞出现烧灼现象，属于备件质量问题造成，更换后故障排除\r\n3.更换一组火花塞', '', '10130351310100', '', '60', '608', '0', '759', null, '43285.064398', '审核索赔单确认关联质量反馈单', '辽PAS161', null, null, null, 'A', '43004', '43024.656933', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1255', 'DYUG030MQI20180726004', 'DYUG030', '', '已确认', '43308.564201', 'DYUG030RO1805010001', 'A1045A', '', '', '', '', '', 'FR2A-0M8', 'F440376', 'MT', '1301', '+EGE45000001J1250B20', 'FR2A-0M8-00-W1-2', '43221', '01', '发动机', '0102', '发动机性能', '010225', '发动机自动熄火（可以再启动）', '客户反应发动机怠速自动熄火，故障频率越来越高，强烈要求换车，要求有代步车，故障期间一切关于车辆的费用店里承担，包括期间的分期费用', '43308.390613', 'B', 'F', '1.我店技师先是用电脑检查无故障；\n\n2.技师检查汽油滤，节气门均无异常，车内无任何加装现象，点烟器处没有外接电源；\n\n3.先让客户换家加油站加油后还是一直出现该故障且频率越来越高；\n 4.我店技师对调火花塞、节气门、点火线圈、喷油嘴、前段排气管等后还是发生故障；\n5.寻求厂家老师进店指导维修后故障排除', '', '10130351820000', '', '176', '3682', '0', '4166', null, '43308.564201', '审核索赔单确认关联质量反馈单', '豫GD011Y', null, null, null, 'A', '43143', '43206', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
