INSERT INTO `mqms_voucher` VALUES ('1277', 'DGDT020MQI20190713015', 'DGDT020', '', '已确认', '43661.567384', 'DGDT020RO1907120014', 'C1430A', '', '', '', '', '', 'HR1A-0A5', 'F309361', 'AT', '1932', 'RA006VJ1011H8210N7B', 'HR1A-0A5-00-Y3-R', '43658', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G146', '断开', '1.车主到店反应车辆仪表显示排放系统故障灯', '43660.403113', 'B', 'H', '1.技师根据车主反馈的故障检查：用检测仪显示失火的故障码，技师检查四缸缸压足够，检查凸轮轴时发现进气凸轮轴有磨损的情况。\r\n2.技师判断需要拆检气缸盖罩检查，拆卸后检查发现机械真空泵齿轮已断裂的现象，分开成一半。凸轮轴和排气相位调节器均有磨损的痕迹。技师判断机械真空泵不良分裂导致故障灯亮。需要更换机油控制阀，进气凸轮轴总成，进气相位调节器，排气相位调节器，机械真空泵。\r\n3.更换配件后，故障排除，车主满意。', '', '10060341830000', '', '28', '353', '0', '433', null, '43661.567384', '审核索赔单确认关联质量反馈单', '粤S13160', null, null, null, 'A', '43003', '43013', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1278', 'DSCG030MQI20190311003', 'DSCG030', '', '已确认', '43550.518218', 'DSCG030RO1903060006', 'C2005', '', '', '', '', '', 'FR2A-0M8', 'H002464', 'MT', '241', '+EGE45000001J5030PEW', 'FR2A-0M8-00-W1-2', '43530', '01', '发动机', '0102', '发动机性能', '010227', '行驶中发动机自动熄火', '1.客户打救援电话，称车辆自动熄火，熄火后，打不燃火', '43535.781366', 'A', 'F', '1.技师到现场救援，初步判断曲轴不能转动，用拖车背车到店\r\n\r\n2.检查发现发动机，无缸压，打燃火火后自动熄火\r\n\r\n3.拆解发动机，发现机油泵齿轮断裂，曲轴已抱死。\r\n\r\n4.因机油泵齿轮断裂，导致发动机高温，曲轴抱死，需更换发动机裸机总成', '', '88100011520000', '', '1064', '14080', '0', '15891', null, '43550.518218', '审核索赔单确认关联质量反馈单', '川B352TV', null, null, null, 'A', '43230', '43476', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
