INSERT INTO `mqms_voucher` VALUES ('1290', 'DHNA070MQI20190820012', 'DHNA070', '', '已确认', '43698.570093', 'DHNA070RO1908170002', 'C1430A', '', '', '', '', '', 'HR1A-0A5', 'D087454', 'AT', '10429', 'RA047VJ1011J3231347', 'HR1A-0A5-00-W1-R', '43694', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100202', '工作不正常或完全不工作', '客户反映车辆行驶中突然熄火。', '43698.377188', 'B', 'H', '1.行驶中突然熄火。\r\n2.维修技师检查未见其他异常，车辆行驶中突然熄火，用新件机油控制阀替换旧件后故障排除，判断为机油控制阀内部故障。\r\n3.更换机油控制阀后故障排除。', '', '10060341310000', '', '8', '300', '0', '353', null, '43698.570093', '审核索赔单确认关联质量反馈单', '湘AY8N89', null, null, null, 'A', '43206', '43224', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1291', 'DGDD030MQI20190827011', 'DGDD030', '', '已确认', '43705.067361', 'DGDD030RO1908210004', 'C1430A', '', '', '', '', '', 'HR1A-0A5', 'H107675', 'AT', '4113', 'RA047VJ1011K2120F0M', 'HR1A-0A5-00-N1-R', '43698', '10', '电气，进气和排气系统，暖风，空调，仪表', '1001', '电气—发动机', '100111', '发动机自动熄火（可以再启动）', '1、车主上星期到我站反映车辆有时会自动熄火，我们登记检查车辆。\r\n2、我站技师读取车辆故障码显示无故障码转态，检查车辆发动机线束和机舱线束无脱针腐蚀现象，相关保险丝和继电器无异常，根据技术专家指导更换排气机油控制阀处理。', '43704.645833', 'C', 'H', '诊断结果：1、车辆有时会自动熄火。\r\n2、我站技师读取车辆故障码显示无故障码转态，检查车辆发动机线束和机舱线束无脱针腐蚀现象，相关保险丝和继电器无异常，根据技术专家指导更换排气机油控制阀处理。\r\n3、更换机油控制阀。', '', '10060341310000', '', '8', '150', '0', '181', null, '43705.067361', '审核索赔单确认关联质量反馈单', '粤DCK075', null, null, null, 'A', '43544', '43640', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1292', 'DSXA030MQI20190908002', 'DSXA030', '', '已确认', '43719.07103', 'DSXA030RO1909050006', 'C1430A', '', '', '', '', '', 'HR1A-0M5', 'H047825', 'MT', '11444', '+EGE46000001J9201C0S', 'HR1A-0M5-00-W1-R', '43713', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G120', '同步动作不良', '客户进站反映车辆有时加速无力。\r\n', '43716.72588', 'B', 'H', '1、因该车为偶发故障无法做测试；\r\n2、检查及处理发动机搭铁故障依旧，经与技术老师沟通建议更换机油控制阀；\r\n3、更换后试车一周故障排除。', '', '10060341310000', '', '32', '900', '0', '1067', null, '43719.07103', '审核索赔单确认关联质量反馈单', '晋A770ZN', null, null, null, 'A', '43393', '43425', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1293', 'DGXB020MQI20190930005', 'DGXB020', '', '已确认', '43739.074815', 'DGXB020RO1909290020', 'C1430A', '', '', '', '', '', 'HR1A-0M5', 'F717496', 'MT', '13', '+EGE46000001K320258X', 'HR1A-0M5-00-R5-R', '43737', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G127', '失灵', '加不上油', '43738.737257', 'B', 'H', '技师检查，启动发动机后发动机抖动，故障灯点亮 故障存在\r\n技师进一步检查，读故障码为机油控制阀故障，技师检查线路正常 \r\n更换新的机油控制阀后故障排除', '', '10060341310000', '', '8', '150', '0', '181', null, '43739.074815', '审核索赔单确认关联质量反馈单', '', null, null, null, 'A', '43570', '', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1294', 'DGDS030MQI20190926005', 'DGDS030', '', '已确认', '43738.602662', 'DGDS030RO1909250002', 'C1430A', '', '', '', '', '', 'HR1A-0M5', 'H091240', 'MT', '8332', '+EGE46000001JC261ULN', 'HR1A-0M5-00-W1-R', '43733', '01', '发动机', '0102', '发动机性能', '010225', '发动机自动熄火（可以再启动）', '客户反映：车辆（偶发）怠速时会自动熄火。', '43734.723449', 'C', 'H', '我店技师检测：\r\n 1：技师用解码仪进行检测无故障码。\r\n 2：检测检测各个部位线路及插头无发现破损及松动现象。\r\n 3：技师查看相关资料，怀疑是机油控制阀，更换检测故障排除，属质量问题需进行保修处理。', '', '10060341830000', '', '8', '1823', '0', '1883', null, '43738.602662', '审核索赔单确认关联质量反馈单', '渝A676PX', null, null, null, 'A', '43480', '43495', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1295', 'DAHS010MQI20190928003', 'DAHS010', '', '已确认', '43737.073391', 'DAHS010RO1909250018', 'C1430A', '', '', '', '', '', 'HR1A-0A5', 'D005476', 'AT', '25770', 'RA047VJ1011HB060733', 'HR1A-0A5-00-W1-R', '43733', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '客户到店反映车子在高速每小时120km行驶过程中突然熄火，车子仪表全部灭屏，后客户在应急车道停车，打开危险信号灯，信号灯工作正常，后客户在次启动车子，仪表已经正常，但车子启动没有任何反应，', '43736.761655', 'C', 'H', '客户反复启动测试5到6次后车子正常启动成功。后客户到店检查，技师根据客户反映上高速测试，未出现此故障，用电脑检测也无任何故障，后技术经理在技术交流群咨询此故障\r\n2 技术经理在交流群里咨询时，发现别家4S店出现过此案例是更换机油控制阀，后给予技术老师联系，技术老师告知给予客户调换代步车机油控制阀测试，后给予测试2个月左右未出现此故障\r\n3 给予客户更换机油控制阀', '', '10060341310000', '', '16', '575', '0', '677', null, '43737.073391', '审核索赔单确认关联质量反馈单', '皖L8J315', null, null, null, 'A', '43075', '43086', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1296', 'DTJA070MQI20191029003', 'DTJA070', '', '已确认', '43768.726574', 'DTJA070RO1909130009', 'C1430A', '', '', '', '', '', 'HR1A-0A5', 'D001105', 'AT', '15027', 'RA047VJ1011HA25125M', 'HR1A-0A5-00-W1-R', '43721', '01', '发动机', '0102', '发动机性能', '010225', '发动机自动熄火（可以再启动）', '客户进场反映行驶中突然熄火,客户反映有时快速行驶70-80迈左右也会突然熄火\r\n', '43767.682975', 'B', 'H', '1.技师通过电脑检测，报故障码P007500(进气VCP液)和P007800(排气VCP液)故障\r\n2.技师倒换试驾车的机油控制阀，让客户试车一段时间，客户反映故障未再次出现\r\n3.更换机油控制阀，故障排除', '', '10060341310000', '', '8', '300', '0', '353', null, '43768.726574', '审核索赔单确认关联质量反馈单', '津RBM507', null, null, null, 'A', '43068', '43085', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1297', 'DSXH010MQI20191027001', 'DSXH010', '', '已确认', '43768.51934', 'DSXH010RO1910270003', 'C1430A', '', '', '', '', '', 'HR1A-0M5', 'H037035', 'MT', '8892', '+EGE46000001J82317LB', 'HR1A-0M5-00-W1-R', '43765', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '客户致电反应车辆正常行驶过程中熄火,加油无力，怠速抖动。', '43765.684444', 'B', 'H', '1、经机修技师多次试车检查，故障确实存在。\r\n2、机修技师使用诊断仪检测发现相关故障码存在。\r\n3、机修技师初步判定为机油控制阀导致故障。\r\n4、机修技师排除人为以及外来因素导致。\r\n5、更换机油控制阀后，故障消除。', '', '10060341310000', '', '8', '300', '0', '353', null, '43768.51934', '审核索赔单确认关联质量反馈单', '晋A210UL', null, null, null, 'A', '43350', '43374', '整理3', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
