INSERT INTO `mqms_voucher` VALUES ('1305', 'DHLM010MQI20180107003', 'DHLM010', '', '已确认', '43108.573275', 'DHLM010RO1801060008', 'Z9999Z', '', '', '', '', '', 'HR1A-0M5', 'F301692', 'MT', '2898', '+EGE46000001H91404C8', 'HR1A-0M5-00-Y3-R', '43106', '01', '发动机', '0107', '泄漏', '010704', '白浊', '客户来店反应车辆在怠速时有响声，且机油灯报警。检查机油尺，发现机油变白。', '43107.67338', 'B', 'H', '1.发动机机油在低温环境下产生机油乳化变白，且内部能看见冰块。\r\n2.经过车间技师检查发现为机油乳化且被冰冻的现象，判断为机油的问题。\r\n3.涮洗发动机多次，此车机油实在是太脏啦。', '', '992S0054', '', '0', '574', '0', '660', null, '43108.573275', '审核索赔单确认关联质量反馈单', '黑M37426', null, null, null, 'A', '42993', '43010.722581', '整理4', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1306', 'DHLM010MQI20180107002', 'DHLM010', '', '已确认', '43155.707963', 'DHLM010RO1801060007', 'Z9999Z', '', '', '', '', '', 'HR1A-0M5', 'F301692', 'MT', '2898', '+EGE46000001H91404C8', 'HR1A-0M5-00-Y3-R', '43106', '01', '发动机', '0107', '泄漏', '010704', '白浊', '客户来电反应，车辆在着车后有响声，经过检查机油，发现机油乳化变白。', '43107.660729', 'B', 'H', '1.发动机机油在经过低温条件后变白并产生水，导致发动机怠速时有声音，且机油灯亮。\r\n2.经过车间技师现场救援检查发现为机油故障，判断为机油故障，涮洗发动机。\r\n3.外出救援，涮洗发动机。', '', '992S0054', '', '0', '0', '0', '0', null, '43155.707963', '审核索赔单确认关联质量反馈单', '黑M37426', null, null, null, 'A', '42993', '43010.722581', '整理4', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
