INSERT INTO `mqms_voucher` VALUES ('1308', 'DSDB030MQI20190123001', 'DSDB030', '', '已确认', '43489.067824', 'DSDB030RO1901200010', 'A1015A', '', '', '', '', '', 'FR2A-0M2', 'H003871', 'MT', '2', '+EGE46000001J5050PZY', 'FR2A-0M2-00-W1-2', '43485', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G999', '其他', '新车进行PDI检测发现机油过多，放出机油是乳白色\r', '43488.641319', 'A', 'F', '1、新车进行PDI检测发现机油过多，放出机油是乳白色\r\r\n2.经检查确认机油确实存在发绿现象；\r\n\r3.着车一小时，放油发现机油依旧是乳白色\r\n\r4、其他油液，液位正常\r\n5、更换发动机机油、机油滤清器、垫片，便于销售交车\r，后期进行跟踪', '', '992S0055', '', '24', '154', '0', '201', null, '43489.067824', '审核索赔单确认关联质量反馈单', '', null, null, null, 'A', '43238', '43480', '整理4', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
