INSERT INTO `mqms_voucher` VALUES ('1318', 'DSCA060MQI20191115013', 'DSCA060', '', '已确认', '43785.565243', 'DSCA060RO1911020006', 'C1435A', '', '', '', '', '', 'HR1A-0A5', 'D232357', 'AT', '14610', 'RA047VJ1011K20100BU', 'HR1A-0A5-00-W1-R', '43771', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '客诉车辆启动后发动机故障灯亮，换挡只有3挡，其余档位都没有', '43784.707465', 'B', 'H', '经技师确认故障存在，技师启动车辆后换挡仪表显示只有三挡,仪表发动机故障灯点亮，使用诊断电脑读取故障为:进气压力传感器故障，技师诊断为该车进气温度压力传感器故障导致车辆换挡只有3挡，需更换进气温度压力传感器，更换后故障排除。', '', '10130142010000', '', '16', '138', '0', '175', null, '43785.565243', '审核索赔单确认关联质量反馈单', '川C7D201', null, null, null, 'A', '43524', '43538', '整理5', null, null, '151', 'MT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
