INSERT INTO `mqms_voucher` VALUES ('1329', 'DYUA070MQI20191024007', 'DYUA070', '', '已确认', '43765.063715', 'DYUA070RO1910140001', 'C1435A', '', '', '', '', '', 'HR1A-0A5', 'F578544', 'AT', '9598', 'RA047VJ1011J7070BYF', 'HR1A-0A5-00-W1-R', '43752', '10', '电气，进气和排气系统，暖风，空调，仪表', '1003', '仪表、时钟', '100302', '故障灯亮（PGM-FI  MIL）', '客户反映车辆正常行驶中仪表上出现故障灯', '43764.704248', 'B', 'H', '1.车辆到店后技师检查：仪表上防侧滑灯，发动机排放灯常亮。故障存在\r\n2.技师用电脑检测读取故障：进气温度传感器线路高电压.然后技师按照维修手册检查保险、线路正常，初步判定为进气温度压力传感器内部故障，对调进气温度压力传感器后故障未出现，技师判定由于进气温度压力传感器内部故障造成\r\n3.申请更换进气温度压力传感器，更换后故障排除', '', '10130142010000', '', '16', '138', '0', '175', null, '43765.063715', '审核索赔单确认关联质量反馈单', '豫A9LG87', null, null, null, 'A', '43314', '43373', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1330', 'DAHC010MQI20191031006', 'DAHC010', '', '已确认', '43770.067442', 'DAHC010RO1910290002', 'C1435A', '', '', '', '', '', 'HR1A-0M8', 'F508987', 'MT', '1878', '+EGE45000001J4120LC4', 'HR1A-0M8-00-R5-R', '43767', '01', '发动机', '0101', '怠速', '010103', '怠速不稳定', '客户反映车辆启动后容易熄火', '43769.655', 'C', 'H', '经我店维修技师检查进气温度压力传感器失灵，需更换', '', '10130142010000', '', '16', '138', '0', '175', null, '43770.067442', '审核索赔单确认关联质量反馈单', '皖CTQ737', null, null, null, 'A', '43215', '43635', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1331', 'DHLA050MQI20190218008', 'DHLA050', '', '已确认', '43524.431435', 'DHLA050RO1901230024', 'C2005', '', '', '', '', '', 'FR2A-0M8', 'D042642', 'MT', '5461', '+EGE45000001J2070CK2', 'FR2A-0M8-00-W1-2', '43488', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '客户来电话反应车辆在行驶中熄火且无法再次着车。\r\n', '43514.43706', 'B', 'F', '1.客户来店反应车辆在行驶中熄火，且无法再次着车。\r\n2.拖回店内，我店经过电脑检查没有故障码存在。\r\n3.拆开油气分离器发现油气分离器内全是冰，并且严重乳化。\r\n4.放出机油检查发现机油呈现乳白色，并且含有大量的冰渣。\r\n5.尝试盘曲轴，发现无法转动，怀疑为发动机抱瓦。\r\n6.拆卸检查后发现第四组轴瓦已经抱死，第五组轴瓦已磨损且主轴已磨损。\r\n7.客户每天行驶路程很近且没有热车的喜欢，水温很少达到正常水温，机油内没有铁屑，我店认为曲轴的磨损是因机油严重乳化导致因气温零下机油凝固，无法润滑。从而导致曲轴磨ᒻ୔\0愴ᒬ\0\0ᒬ뗐灲\0灲幠皚\0\0V\0먡灲彀Ǩ癦\0\0', '', '88100011520000', '', '1064', '14038', '0', '15843', null, '43524.431435', '审核索赔单确认关联质量反馈单', '黑F80F87', null, null, null, 'A', '43143', '43194', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1332', 'DGDW010MQI20190306003', 'DGDW010', '', '已确认', '43535.594931', 'DGDW010RO1903010009', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D070660', 'AT', '13484', 'RA047VJ1011J223135M', 'HR1A-0A5-00-W1-R', '43525.597465', '0103', '噪音，振动', '01', '发动机', '010302', '异响', '客户到店反映发动机哒哒异响\r\n', '43530.740405', 'A', 'H', '1.经维修技师检查，该车确实存在发动机位置哒哒异响的情况（请见附件视频）；\r\n2.技师经过排查，该异响随着转速越高异响越大，拆除发动机皮带后检测异响依然存在，用听诊器精确排查，发现异响是由发动机内部发出，经拆检发现曲轴、连杆及气缸体损坏引起；\r\n3.需更祼机套件总成，故障排除。\r\n', '', '88100011520000', '', '568', '14107', '0', '15425', null, '43535.594931', '审核索赔单确认关联质量反馈单', '粤WHW059', null, null, null, 'A', '43184', '43215', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1333', 'DNME020MQI20190320010', 'DNME020', '', '已确认', '43555.716655', 'DNME020RO1903160006', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'F368881', 'AT', '4781', 'RA047VJ1011HA160N75', 'HR1A-0A5-00-W1-R', '43540', '01', '发动机', '0102', '发动机性能', '010209', '失火', '客户来电反映车辆在行驶过程中听见机舱发出啪啪两声后车辆失火，再次启动车辆无法启动。', '43544.586991', 'A', 'H', '1、客户来电反映车辆在行驶过程中听见机舱发出啪啪两声后车辆失火，再次启动车辆无法启动。\r\n2、经维修技师检查盘曲轴只能来回盘半圈有卡死状态，放机油检查机油内部有大量金属碎屑，拆解检查发现曲轴连杆断裂，油底内部有大量金属碎屑，最终判定故障是由于连杆断裂导致的发动机失火。\r\n3、更换后故障消除，恢复正常。', '', '88100011520000', '', '568', '14342', '0', '15696', null, '43555.716655', '审核索赔单确认关联质量反馈单', '蒙E0181H', null, null, null, 'A', '43063', '43076', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1334', 'DHLA050MQI20190311001', 'DHLA050', '', '已确认', '43555.721493', 'DHLA050RO1903060020', 'C1001A', '', '', '', '', '', 'HR1A-0M5', 'D078076', 'MT', '4887', '+EGE46000001J3290JGZ', 'HR1A-0M5-00-W1-R', '43530', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '客户描述车辆在外停放一夜后，次日启动车辆后行驶约1KM左右后，车辆出现异常抖动情况，客户将车辆熄火后，再次打火无法启动。\r\n', '43535.477431', 'B', 'H', '1.我店技师使用检测仪检查确认该车辆无故障码。\r\n2.我店技师将该车辆机油放出发现该车辆机油大约5升左右。\r\n2.汽油压力及机油压力正常。 \r\n3.缸压正常 。\r\n4.拆卸该车辆排气歧管检查发现车辆一缸正常进排气，二三四缸无排气。\r\n5.我店技师拆卸气缸盖罩检查发现该车辆排气凸轮轴断裂。\r\n6.我店咨询区域技师老师审核后，对其裸机套件总成保修处理。\r\n', '', '88100011520000', '', '568', '14053', '0', '15364', null, '43555.721481', '审核索赔单确认关联质量反馈单', '黑A6FK08', null, null, null, 'A', '43192', '43213', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1335', 'DNME020MQI20180207012', 'DNME020', '', '已确认', '43173.713843', 'DNME020RO1801310002', 'C1001A', '', '', '', '', '', 'HR1A-0M5', 'C959547', 'MT', '2118', '+EGE46000001H922055C', 'HR1A-0M5-00-W1-R', '43131', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '客户来电反映车辆着车时车身抖动严重无法正常行驶。', '43138.572569', 'A', 'H', '1、客户来电反映车辆着车时车身抖动严重无法正常行驶。\r\n2、用电脑检测仪检测无故障码，检查火花塞及点火线圈无异常，用缸压表测量发动机缸压，四缸显示无缸压。\n进一步拆解检查，观察冷却液无缺失，发现发动机机油呈土黄色，放出机油观察发现机油底部有亮晶晶的金属物质。经技术咨询最终确认发动机四缸拉缸，需更换裸机总成。\r\n3、更换后故障消除，恢复正常。', '', '88100011520000', '', '568', '14237', '0', '15575', null, '43173.713843', '审核索赔单确认关联质量反馈单', '蒙E3H007', null, null, null, 'A', '43004', '43034.67963', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1336', 'DHLB010MQI20180330016', 'DHLB010', '', '已确认', '43217.712373', 'DHLB010RO1803030019', 'C1001A', '', '', '', '', '', 'HR1A-0M5', 'F308058', 'MT', '1468', '+EGE46000001H92004V7', 'HR1A-0M5-00-W1-R', '43162', '01', '发动机', '0101', '怠速', '010103', '怠速不稳定', '客户反映：车辆异常抖动、', '43189.717072', 'B', 'H', '1.车辆进场与客户试车确实有此故障\r\n2、缸压表检查4缸缸压低于4，其他缸缸压正常\r，加注机油测试，四缸缸压无变化\r，检查正时；确认无异常\r\r\n3.更换裸机，试车故障排除', '', '88100011520000', '', '568', '13881', '0', '15166', null, '43217.712373', '审核索赔单确认关联质量反馈单', '黑BVN080', null, null, null, 'A', '43000', '43025.674005', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1337', 'DHNM010MQI20180620003', 'DHNM010', '', '已确认', '43281.595648', 'DHNM010RO1806200013', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D044889', 'AT', '424', 'RA047VJ1011J11005Y9', 'HR1A-0A5-00-W1-R', '43271', '01', '发动机', '0102', '发动机性能', '010209', '失火', '客户来店反映，车辆行驶中突然提不起速，加速无力，且怠速停在原地抖动', '43271.710903', 'B', 'H', '1、客户来店反映，车辆行驶中突然提不起速，加速无力，且怠速停在原地抖动\r\n2、我店维修技师人员用电脑诊断仪读取整车系统，发现发动机电控系统出现单缸多缸失火现象。检查点火线圈，喷油嘴，发动机电脑，及线束均正常。检查发动机机油尺油面在正常范围，检查防冻液液面在正常范围。拆下点火花塞，发现第四缸火花塞发黑。测量一，二，三，缸压为11-12公斤压力左右，四缸压力为4公斤左右。检查正时相位，正常。拆开缸盖，气门未发现异常。拆开第四缸活塞发现中间有一条裂缝（开裂）。\r\n3、更换发动机裸机套件总成后，故障排除。（已向技ᒻ୔\0愴ᒬ\0\0ᒬ뗐灲\0', '', '88100011520000', '', '568', '13909', '0', '15198', null, '43281.595648', '审核索赔单确认关联质量反馈单', '无牌', null, null, null, 'A', '43139', '43152.519363', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1338', 'DGDW010MQI20181229007', 'DGDW010', '', '已确认', '43476.503808', 'DGDW010RO1812110007', 'C1002F', '', '', '', '', '', 'HR1A-0A5', 'D070660', 'AT', '11361', 'RA047VJ1011J223135M', 'HR1A-0A5-00-W1-R', '43445.477512', '0103', '噪音，振动', '01', '发动机', '010302', '异响', '客户到店反映发动机哒哒异响\r\n', '43463.731713', 'B', 'H', '1.经维修技师检查，该车确实存在发动机位置哒哒异响的情况（请见附件视频）；\r\n2.技师经过排查，该异响随着转速越高异响越大，拆除发动机皮带后检测异响依然存在，用听诊器精确排查，发现异响是由发动机内部发出，检测机油压力、缸压正常，判定曲轴、连杆损坏引起；\r\n3.需更换曲轴、连杆、活塞及附件、辅料，异响排除。\r\n', '', '10050041510000', '', '1440', '4858', '0', '6947', null, '43476.503808', '审核索赔单确认关联质量反馈单', '粤WHW059', null, null, null, 'A', '43184', '43215', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1339', 'DYUE030MQI20180210002', 'DYUE030', '', '已确认', '43185.469479', 'DYUE030RO1802070006', 'C1001A', '', '', '', '', '', 'HR1A-0M5', 'C959569', 'MT', '4712', '+EGE46000001H925058B', 'HR1A-0M5-00-W1-R', '43138', '01', '发动机', '0103', '噪音，振动', '010304', '敲打声', '客户进站做首保时反应车辆发动机声音不正常，有异响。\r', '43141.761898', 'B', 'H', '1.维修技师启动车辆发现发动机存在明显异响，类似“哒哒”声且十分严重，随着转速升高异响声音变大，检查机油油位正常无缺少，车辆无故障码提示。\r\n\r2.更换机油滤清器，重新试车，异响依然存在且声音无减小，排除机油滤清器堵塞。\r\r\n3.检查机油压力正常，水温升至90度怠速时机油压力为490kpa不低于正常值，加油转速表上升至5000转时油压升至660kpa，机油压力正常。更换汽油异响故障依然存在，且声音无减小，排除油品问题。\r\n\r4.维修技师判定为凸轮轴异响，但车辆为新车，客户要求更换发动机总成。\r', '', '88100011520000', '', '568', '13788', '0', '15058', null, '43185.469479', '审核索赔单确认关联质量反馈单', '豫E83Z93', null, null, null, 'A', '43004', '43026.747442', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1340', 'DYUE030MQI20180502025', 'DYUE030', '', '已确认', '43247.566296', 'DYUE030RO1804180002', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D050214', 'AT', '1050', 'RA047VJ1011J1260ZCT', 'HR1A-0A5-00-W1-R', '43208', '01', '发动机', '0103', '噪音，振动', '010304', '敲打声', '客户进站反应车辆发动机声音不正常，有异响。\r', '43222.644873', 'B', 'H', '1.启动车辆发现发动机存在明显异响，类似“哒哒”声且十分严重，随着转速升高异响声音变大，检查机油油位正常无缺少，车辆无故障码提示。\r\n\r2.更换机油滤清器，重新试车，异响依然存在且声音无减小，排除机油滤清器堵塞。维修技师检查机油压力，显示正常无故障。\r\r\n3.维修技师判定为凸轮轴异响，更换发动机总成，异响消失，故障排除。', '', '88100011520000', '', '568', '13788', '0', '15058', null, '43247.566296', '审核索赔单确认关联质量反馈单', '豫E07Z10', null, null, null, 'A', '43156', '43163.691701', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1341', 'DGDK010MQI20190323020', 'DGDK010', '', '已确认', '43555.384583', 'DGDK010RO1903190016', 'C3020A', '', '', '', '', '', 'HR1A-0A5', 'H012608', 'AT', '31969', 'RA047VJ1011J60505FC', 'HR1A-0A5-00-W1-R', '43543', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G149', '漏水', '客户到店反映车辆的冷却液出现渗漏油现象。', '43547.709954', 'C', 'H', '1.经检查，发现车辆的冷却液减少，进一步检查，发现是暖风箱进水管与机头旁硬管出现冷却液渗漏。判断是因工艺缺陷，密封性不严，导致出现冷却液渗漏。\r\n2.经更换气缸盖总成及其配件后，试车正常，故障正常。', '', '10030051520000', '', '688', '1386', '0', '2280', null, '43555.384583', '审核索赔单确认关联质量反馈单', '粤K13L32', null, null, null, 'A', '43286', '43294', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1342', 'DYUE030MQI20180319011', 'DYUE030', '', '已确认', '43185.470289', 'DYUE030RO1803180002', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D048037', 'AT', '16', 'RA047VJ1011J11108JA', 'HR1A-0A5-00-W1-R', '43177', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '车辆做售前PDI检测时发现发动机漏油。', '43178.816794', 'B', 'H', '1.车辆在做售前PDI检测时发现发动机下方有油滴，维修技师检查发现油是从发动机缸盖处渗出流向发动机下方。\r\r\n2.车辆为商品车，确定未有任何外力作用或人为干涉。\r\r\n3.维修技师判定为缸盖密封不良导致漏油，需更换发动机总成。\r', '', '992S0055', '', '568', '13788', '0', '15058', null, '43185.470289', '审核索赔单确认关联质量反馈单', '', null, null, null, 'A', '43143', '', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1343', 'DHBA020MQI20181230008', 'DHBA020', '', '已确认', '43465.064421', 'DHBA020RO1812280023', 'C3020A', '', '', '', '', '', 'HR1A-0A5', 'D001206', 'AT', '34539', 'RA047VJ1011HA2511QL', 'HR1A-0A5-00-N1-R', '43462', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '客户来店检查发现三，四缸内有明显油渍.', '43464.456748', 'B', 'H', '1.检查时发现三，四缸内有明显油渍；\r\n2.检查发动机缸盖边缘无漏油现象，取下三，四缸火花塞发现火花塞上有明显有油渍，检查气缸盖罩外侧也无漏油现象，拆下气缸盖罩后发现是因气缸盖罩密封不良导致有机油渗漏到三，四缸内，需拆装气缸盖罩打胶；\r\n3.更换气缸盖罩并重新打胶后试车，漏油故障消除，索赔气缸盖罩打胶工时。', '', '10030271310000', '', '1448', '60', '0', '1517', null, '43465.064421', '审核索赔单确认关联质量反馈单', '鄂A0ZU72', null, null, null, 'A', '43068', '43075', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
