INSERT INTO `mqms_voucher` VALUES ('1346', 'DHBA020MQI20190126039', 'DHBA020', '', '已确认', '43492.066354', 'DHBA020RO1901240070', 'C3020A', '', '', '', '', '', 'HR1A-0A5', 'D034076', 'AT', '10721', 'RA047VJ1011HC140LF8', 'HR1A-0A5-00-W1-R', '43489', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '客户来店检查发现缸内有明显油渍', '43491.579583', 'B', 'H', '1.检查时发现缸内有明显油渍；\r\n2.检查发动机缸盖边缘无漏油现象，取下三，四缸火花塞发现火花塞上有明显有油渍，检查气缸盖罩外侧也无漏油现象，拆下气缸盖罩后发现是因气缸盖罩密封不良导致有机油渗漏到三，四缸内，需拆装气缸盖罩打胶；\r\n3.更换气缸盖罩并重新打胶后试车，漏油故障消除，索赔气缸盖罩打胶工时。', '', 'M8619021', '', '1468', '90', '0', '1572', null, '43492.066354', '审核索赔单确认关联质量反馈单', '鄂A8D7G8', null, null, null, 'A', '43124', '43131', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1347', 'DGDE070MQI20191024011', 'DGDE070', '', '已确认', '43769.584248', 'DGDE070RO1910070017', 'C3020A', '', '', '', '', '', 'HA1A-0A5', 'H005402', 'AT', '38967', 'JAN28VJ1017J50700QY', 'HA1A-0A5-01-W1-R', '43745', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '车间到点反映车子的发动机很抖', '43764.925035', 'C', 'H', '1、对该车的发动机抖动大进行检查，发现有水电正常无故障，用缸压表测量时发现四缸缸压不足，缸压只有9 MPA，属于不正常，判断是缸盖气门漏气导致，其他缸缸内均在12MPA以上；确认四缸缸内漏气导致缸压不足；需要更换；\r\n2、检查该车的气缸盖并没有拆装的痕迹；\r\n3、更换气缸盖后，使用正常，车主满意；', '使用化清剂45元。', '88100031510000', '', '688', '5604', '0', '6876', null, '43769.584248', '审核索赔单确认关联质量反馈单', '粤RPJ733', null, null, null, 'A', '43262', '43271', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1348', 'DJLE010MQI20191117012', 'DJLE010', '', '已确认', '43786.565012', 'DJLE010RO1911120015', 'C3020A', '', '', '', '', '', 'HR1A-0M5', 'F292197', 'MT', '31194', '+EGE46000001H90203LW', 'HR1A-0M5-00-W1-R', '43781', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G150', '漏油', '客户进店检查底盘，检查发现汽缸盖后堵塞漏油', '43786.476806', 'B', 'H', '1.检查故障存在，汽缸盖后堵塞漏油.\r\n2.经检查无事故碰撞痕迹，无人为拆解和破坏的痕迹，诊断为堵塞故障。\r\n3.更换堵塞故障清除。', '', '10080242010000', '', '104', '8', '0', '113', null, '43786.565012', '审核索赔单确认关联质量反馈单', '吉F7S517', null, null, null, 'A', '42984', '43007', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1349', 'DHBA020MQI20190113018', 'DHBA020', '', '已确认', '43479.066887', 'DHBA020RO1901070020', 'C3020A', '', '', '', '', '', 'HR1A-0M5', 'F294073', 'MT', '12423', '+EGE46000001H90703T8', 'HR1A-0M5-00-W1-R', '43472', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '客户来店检查发现缸内有明显油渍', '43478.786412', 'B', 'H', '1.检查时发现缸内有明显油渍；\r\n2.检查发动机缸盖边缘无漏油现象，取下三，四缸火花塞发现火花塞上有明显有油渍，检查气缸盖罩外侧也无漏油现象，拆下气缸盖罩后发现是因气缸盖罩密封不良导致有机油渗漏到三，四缸内，需拆装气缸盖罩打胶；\r\n3.更换气缸盖罩并重新打胶后试车，漏油故障消除，索赔气缸盖罩打胶工时。', '', 'M8619021', '', '1468', '151', '0', '1642', null, '43479.066887', '审核索赔单确认关联质量反馈单', '鄂A7D7M5', null, null, null, 'A', '42986', '43003', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1350', 'DJIB070MQI20190127002', 'DJIB070', '', '已确认', '43496.861968', 'DJIB070RO1901240002', 'C1001A', '', '', '', '', '', 'HR1A-0M8', 'D044013', 'MT', '14147', '+EGE45000001J2060CC1', 'HR1A-0M8-00-W1-R', '43489', '0107', '泄漏', '01', '发动机', '010705', '冷却液泄漏', '发动机缸体防冻液泄露', '43492.462025', 'A', 'H', '1.发动机缸体防冻液泄露\r\n2.经打压测试确定为发动机缸体四缸处有砂眼导致。\r\n3.经技术老师批准保修更换发动机裸机总成', '', '88100011520000', '', '568', '14108', '0', '15427', null, '43496.861968', '审核索赔单确认关联质量反馈单', '冀B2KG30', null, null, null, 'A', '43138', '43176', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1351', 'DYNA040MQI20190518018', 'DYNA040', '', '已确认', '43613.79088', 'DYNA040RO1905090069', 'C1002F', '', '', '', '', '', 'HR1A-0M5', 'F288394', 'MT', '17562', '+EGE46000001H82903HF', 'HR1A-0M5-00-W1-R', '43594', '01', '发动机', '0107', '泄漏', '010705', '冷却液泄漏', '该车在使用过程中，客户反映车辆停放一夜后发现底盘下部有水泄漏。\r', '43606.783843', 'B', 'H', '1.经检查故障存在，底盘下部有水泄漏。\r2.举升车辆检查，外观无明显损坏。检查各水管无漏液现象，拆检附件检查发现缸体部位有水迹，经清洗干净后试车故障未消失。仔细检查发现是缸体有沙眼导致防冻液泄漏。\r3.更换缸体套件总成后故障消失。', '', '88100021520000', '', '1480', '10526', '0', '12195', null, '43613.79088', '审核索赔单确认关联质量反馈单', '云A50R11', null, null, null, 'A', '42982', '43004', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1352', 'DYUK010MQI20181129015', 'DYUK010', '', '已确认', '43434.718252', 'DYUK010RO1811230017', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D134888', 'AT', '2235', 'RA047VJ1011J6070A3G', 'HR1A-0A5-00-W1-R', '43427', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G150', '漏油', '客户来店首保时，反馈新车发动机严重漏油，要求解决。\r', '43433.819537', 'C', 'H', '1.检查机油已未到标尺，检查底盘有大面积油渍痕迹，检查底盘无碰撞痕迹，从发动机油底壳放油螺孔处放油，只有1升左右机油。\r\n\r2.检查发动机外观无拆卸及无维修，无碰撞痕迹\r\n\r3.查询零部件配件图，无单独发动机此油道堵头配件。确认发动机缸体上油道堵头泄露.\r\r\n4.经技术科老师同意后，更换裸机。\r\n5.保修更换发动机裸机后，客户满意离去。', '', '88100011520000', '', '568', '13736', '0', '14999', null, '43434.718252', '审核索赔单确认关联质量反馈单', '豫K988A7', null, null, null, 'A', '43285', '43328', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1353', 'DYNA040MQI20190518017', 'DYNA040', '', '已确认', '43613.889109', 'DYNA040RO1905150038', 'C3020A', '', '', '', '', '', 'HR1A-0M5', 'F299796', 'MT', '10869', '+EGE46000001H91103ZC', 'HR1A-0M5-00-R5-R', '43600', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '该车在使用过程中，客户反映仪表发动机故障灯亮且发动机抖动大。\r\r', '43606.783831', 'B', 'H', '1.经检查故障存在，发动机确实有抖动现象。\r2.用检测仪检测读出故障代码P030000 单缸或多缸失火 用汽油压力表检查，油压正常。\r3.清洗喷油嘴后重新加注汽油故障依旧。拆检火花塞及点火线圈外观无异常现象，对调火花塞及点火线圈后试车，故障仍存在。\r4.测量四缸缸压发现第一缸缸压不足为6.5Kpa。二缸缸压为7.5Kpa .对调喷油嘴后试车故障依旧，对调相位传感器后无变化。\r5.检查各线路保险无腐蚀异常损坏现象，拆检正时后无跳齿现象。拆检缸盖检查发现是缸盖漏气导致。6。更换缸盖套件后故障消失。', '', '88100031520000', '', '688', '5956', '0', '6766', null, '43613.889109', '审核索赔单确认关联质量反馈单', '云AA0R30', null, null, null, 'A', '42991', '43038', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1354', 'DGXA010MQI20190526002', 'DGXA010', '', '已确认', '43615.704132', 'DGXA010RO1905170013', 'C2004', '', '', '', '', '', 'FR2A-0A5', 'H006311', 'AT', '197', 'FAP34VJ1016J51600DN', 'FR2A-0A5-00-W1-2', '43602.512384', 'G06', '其它故障', 'BXGZDM', '保修申请故障代码', 'G148', '漏气', '顾客到店抱怨发动机抖动。', '43611.756933', 'A', 'F', '1、查询车辆无事故维修记录。拆检火花塞，点火线圈进行检查，没有发现任何异常，属于原厂配件。读取故障代码见附件。用缸压表分别测量1—4缸的气缸压力，发现第一缸压为0KPa，缸压异常。技术服务单号：TF190502014。\r\n2、更换缸盖套件总成，试车故障排除。', '', '88100031520000', '', '1032', '5743', '0', '7378', null, '43615.704132', '审核索赔单确认关联质量反馈单', '无车牌', null, null, null, 'A', '43244', '43249', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1355', 'DJIF030MQI20190111003', 'DJIF030', '', '已确认', '43496.861968', 'DJIF030RO1812180023', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'H010415', 'AT', '1758', 'RA047VJ1011J5220W0P', 'HR1A-0A5-00-W1-R', '43452', '01', '发动机', '0105', '启动性能', '010502', '发动机不能启动（起动机工作）', '客户拨打我店救援电话反映车辆无法着车', '43476.681481', 'B', 'H', '1、客户拨打我店救援电话反映车辆无法着车\r\n2、技师将车辆拖回店里检查，发现情况属实，检查蓄电池电量充足，起动机工作转一下后卡死，车辆上举升机升起，盘车，正向盘动曲轴，发现曲轴无法盘动。不正常，拆下火花塞，发现一缸火花塞被顶坏，其余火花塞正常。观察一缸活塞顶部，有明显伤痕。判断为发动机机械故障导致发动机不能正常着车，检查发动机无外力撞击过、无保险事故过、无拆解过痕迹，机油正常\r，更换发动机后试车故障消除\r\n3、保修更换裸机套件总成', '', '88100011520000', '', '568', '14403', '0', '15766', null, '43496.861968', '审核索赔单确认关联质量反馈单', '冀F5WC02', null, null, null, 'A', '43272', '43335', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1356', 'DJXB010MQI20190529001', 'DJXB010', '', '已确认', '43615.066308', 'DJXB010RO1905200018', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'D064776', 'AT', '17011', 'RA047VJ1011J2190TS8', 'HR1A-0A5-00-W1-R', '43605', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '客户来店反映车子发动机舱有大量油渍，并且有异响\r', '43614.627083', 'C', 'H', '1.检查该车无事故，无人为拆装痕迹\r2.用电脑检测无故障码\r3.将车举起拆下护板发现发动机前部有较多油渍，用听诊器听发动机上部有哒哒异响\r4.我店技师初步诊断可能是曲轴油封渗油导致；\r\n拆下附件检测发现正时链条盖、多楔带、曲轴减震皮带轮多有油渍；\r\n征得厂家技术老师指引保修更换受损零件。', '', '10050351310100', '', '448', '865', '0', '1443', null, '43615.066308', '审核索赔单确认关联质量反馈单', '赣BEH508', null, null, null, 'A', '43176', '43211', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1357', 'DJXA020MQI20190609003', 'DJXA020', '', '已确认', '43625.565972', 'DJXA020RO1906040007', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'H074273', 'AT', '20976', 'RA047VJ1011JB05064M', 'HR1A-0A5-00-W1-R', '43620', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G150', '漏油', '客户进店反映车辆有漏油现象', '43625.441597', 'B', 'H', '1.客户进店反映车辆有漏油现象\r\n2.技师检查发现：确实如客户所说，是由于前油封品质问题导致的，检查发现无任何人为损坏现象\r\n3.更换前油封，故障消失', '', '10050351310100', '', '512', '1181', '0', '1870', null, '43625.565972', '审核索赔单确认关联质量反馈单', '赣C0060D', null, null, null, 'A', '43444', '43458', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1358', 'DSXH010MQI20190622002', 'DSXH010', '', '已确认', '43638.566088', 'DSXH010RO1906200021', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'F673701', 'AT', '1721', 'RA047VJ1011JC170RGV', 'HR1A-0A5-00-W1-R', '43636', '01', '发动机', '0107', '泄漏', '010702', '机油泄漏', '客户到店反映车辆底盘有油迹', '43638.525799', 'B', 'H', '1、经机修技师举升车辆检查，故障确实存在。\r\n2、机修技师检查油迹从曲轴后油封位置漏出。\r\n3、机修技师排除人为以及外来痕迹。\r\n4、更换曲轴后油封后，故障消除。\r\n', '', '88020281310100', '', '448', '454', '0', '970', null, '43638.566088', '审核索赔单确认关联质量反馈单', '晋HTL811', null, null, null, 'A', '43478', '43497', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1359', 'DHBB010MQI20191108003', 'DHBB010', '', '已确认', '43778.065324', 'DHBB010RO1910130018', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'H085611', 'AT', '6618', 'RA047VJ1011JB130L2B', 'HR1A-0A5-00-W1-R', '43751', '03', '悬挂，车轮，传动轴', '0305', '泄漏', '030501', '机油泄漏', '客户进店反应底盘渗油', '43777.641505', 'B', 'H', '1.经检查该车无碰撞损伤\r\n2.技师拆开检查发现是曲轴后油封总成套件，需拆开重新更换\r\n3.技师更换油封后，并清洗油渍，客户试车后表示满意\r\n4.根据保修政策予以保修', '', '88020281310100', '', '448', '598', '0', '1135', null, '43778.065324', '审核索赔单确认关联质量反馈单', '鄂B56982', null, null, null, 'A', '43455', '43497', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1360', 'DJXB030MQI20191115001', 'DJXB030', '', '已确认', '43786.065949', 'DJXB030RO1911020003', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'H042068', 'AT', '13494', 'RA047VJ1011J8090FCP', 'HR1A-0A5-00-W1-R', '43771', '01', '发动机', '0107', '泄漏', '010703', '机油渗漏', '客户来店反映该车底盘漏油', '43785.698889', 'B', 'H', '1.技师检查发现故障跟客户反映一致，发动机与变速箱结合部位有积油，检查发现曲轴后油封密封性不良导致渗油\r\n2.更换新的油封故障排除', '', '88020281310100', '', '463', '612', '0', '1167', null, '43786.065949', '审核索赔单确认关联质量反馈单', '赣BQP667', null, null, null, 'A', '43364', '43437', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1361', 'DJIB070MQI20191114001', 'DJIB070', '', '已确认', '43784.066829', 'DJIB070RO1911070011', 'C2220A', '', '', '', '', '', 'HR1A-0A5', 'H020685', 'AT', '20820', 'RA047VJ1011J6110FJN', 'HR1A-0A5-00-W1-R', '43776', 'BXGZDM', '保修申请故障代码', 'G06', '其它故障', 'G150', '漏油', '客户反应底盘变速箱与发动机结合处有漏油', '43783.725312', 'B', 'H', '1.客户反应底盘变速箱与发动机结合处有漏油。\r\n2.我站维修技师支车检查发现变速箱与发动机结合处有大量油迹，清洗后试车油迹重新出现，拆卸检查后发现曲后油封处漏油，判断为油封密封不严导致\r\n3.更换曲后油封后故障排除。', '', '88020281310100', '', '448', '524', '0', '1051', null, '43784.066829', '审核索赔单确认关联质量反馈单', '冀B9YW27', null, null, null, 'A', '43294', '43308', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1362', 'DJIT010MQI20191003001', 'DJIT010', '', '已确认', '43749.714873', 'DJIT010RO1909300017', 'C2220A', '', '', '', '', '', 'HR1A-0M5', 'H066251', 'MT', '7602', '+EGE46000001JA301J1F', 'HR1A-0M5-00-W1-R', '43738', '01', '发动机', '0104', '故障（功能，作动不良）', '010403', '作动不良', '1.车辆无改装\r\n2.车辆在正常状态下，曲轴皮带轮断裂', '43741.377199', 'B', 'H', '1.车辆无改装\r\n2.车辆在正常状态下，曲轴皮带轮断裂\r\n3.检查因曲轴减震皮带轮半圆键松动导致故障\r\n4.更换曲轴减震皮带轮、半圆键、前油封后故障排除', '', '10050341510000', '', '448', '147', '0', '617', null, '43749.714873', '审核索赔单确认关联质量反馈单', '黑A6W0K7', null, null, null, 'A', '43409', '43453', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1363', 'DYNA070MQI20180729011', 'DYNA070', '', '已确认', '43311.064294', 'DYNA070RO1807180023', 'C5010A', '', '', '', '', '', 'HR1A-0A5', 'D057386', 'AT', '3386', 'RA047VJ1011J20505TY', 'HR1A-0A5-00-W1-R', '43299', '01', '发动机', '0104', '故障（功能，作动不良）', '010401', '故障灯亮（PGM-FI  MIL）', '客户反应有故障灯点亮。', '43310.613831', 'B', 'H', '经检查故障存在，因三元催化转化效率低导致故障，更换排气歧管后故障消失。', '', '10100161520000', '', '247', '1472', '0', '1940', null, '43311.064294', '审核索赔单确认关联质量反馈单', '云A84E10', null, null, null, 'A', '43165', '43206', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1364', 'DSDQ010MQI20190921011', 'DSDQ010', '', '已确认', '43735.073565', 'DSDQ010RO1908300017', 'C5016A', '', '', '', '', '', 'HR1A-0A5', 'D031763', 'AT', '30660', 'RA047VJ1011HC180PUW', 'HR1A-0A5-00-W1-R', '43707', '10', '电气，进气和排气系统，暖风，空调，仪表', '1003', '仪表、时钟', '100302', '故障灯亮（PGM-FI  MIL）', '客户来店检查尾气排放灯亮。', '43734.606678', 'B', 'H', '1.根据客户反应进行检查，在行驶过程中尾气排放故障灯亮。\r\n2.用电脑检查故障并清洗三元催化，当时故障灯清楚，客户行驶两天再次来店反应尾气排放故障灯亮，于是拆开进行检查，查下排气管前端，发现排气歧管内三元催化损坏造成故障灯亮，需更换排气支管总成。\r\n3.更换排气歧管后故障排除。', '', '10100161520000', '', '160', '1316', '0', '1673', null, '43735.073565', '审核索赔单确认关联质量反馈单', '鲁DMA576', null, null, null, 'A', '43120', '43128', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1365', 'DSDP010MQI20190910001', 'DSDP010', '', '已确认', '43719.07103', 'DSDP010RO1909090001', 'C5016A', '', '', '', '', '', 'HR1A-0A5', 'D231693', 'AT', '2739', 'RA047VJ1011K1220S34', 'HR1A-0A5-00-W1-R', '43717', '11', '仪表，内饰，车身', '1104', '故障（功能，作动不良）', '110401', '工作不正常或完全不工作', '1.客户车辆提不上速拆卸检查。', '43718.61735', 'B', 'H', '1.拆卸三元催化器以及氧传感器时发现，厂商人员在装配时螺丝未对准强上导致螺丝滑丝。\r\n2.建议更换新的催化器总成。', '', '10100161520000', '', '160', '1340', '0', '1701', null, '43719.07103', '审核索赔单确认关联质量反馈单', '鲁P45558', null, null, null, 'A', '43530', '43573', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1366', 'DGDT020MQI20190921018', 'DGDT020', '', '已确认', '43730.075729', 'DGDT020RO1909180034', 'C1425A', '', '', '', '', '', 'HR1A-0M5', 'F298770', 'MT', '43525', '+EGE46000001H90803W1', 'HR1A-0M5-00-W1-R', '43726', '01', '发动机', '0104', '故障（功能，作动不良）', '010402', '检查指示灯点亮(PGM-FI(MIL)除外)', '1.车主到店检查发动机故障灯亮.\r\n2.车主多次反应发动机故障灯亮\r\n3.故障后无进行其它操作', '43729.732245', 'B', 'H', '1.技师使用诊断电脑读出有“P01300”故障码。\r\n2.师傅判断前氧传感器内部损坏老化。\r\n3.更换新的前氧传感器解决该故障，顾客表示满意', '', '10130201520000', '', '80', '281', '0', '403', null, '43730.075729', '审核索赔单确认关联质量反馈单', '粤T9836V', null, null, null, 'A', '42990', '43008', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
