INSERT INTO `mqms_voucher` VALUES ('1378', 'DGDB020MQI20180623025', 'DGDB020', '', '已确认', '43281.797176', 'DGDB020RO1806200035', 'C5010A', '', '', '', '', '', 'HR1A-0A5', 'D018602', 'AT', '13937', 'RA047VJ1011HC0101X5', 'HR1A-0A5-00-W1-R', '43271', '10', '电气，进气和排气系统，暖风，空调，仪表', '1003', '仪表、时钟', '100302', '故障灯亮（PGM-FI  MIL）', '客户到店反应组合仪表亮排放故障灯', '43274.772616', 'B', 'H', '1.技师查看存在排放故障现象\r\n2.技师检查线路没有异常现象，检查传感器没有发现异常，后电脑检查发现氧传感器故障码，检查氧传感器没有异常现象，因此判断氧传感器导致故障\r\n3.更换前氧传感器解决问题', '', '10130201520000', '', '116', '281', '0', '439', null, '43281.797176', '审核索赔单确认关联质量反馈单', '粤VNT152', null, null, null, 'A', '43098', '43112.659907', '整理5', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
