INSERT INTO `mqms_voucher` VALUES ('1426', 'DJLA040MQI20180304013', 'DJLA040', '', '已确认', '43168.647512', 'DJLA040RO1803040012', 'C3020A', '', '', '', '', '', 'HR1A-0M2', 'C964745', 'MT', '2398', '+EGE46000001H92705HY', 'HR1A-0M2-00-W1-R', '43163', 'BXGZDM', '保修申请故障代码', 'G05', '功能故障', 'G109', '噪音', '客户反映车辆加速无力，只能行驶时60KM/h，发动机故障灯亮，诊断仪检测无法清除故障码，发动机怠速时有异常的嗡嗡的响声', '43163.659688', 'B', 'H', '1.客户反映车辆加速无力，只能行驶时60KM/h，发动机故障灯亮，诊断仪检测无法清除故障码，发动机怠速时有异常的嗡嗡的响声\r\n\n\n2.进店维修技师检查故障现象如客户所说，诊断仪检查读取故障码凸轮轴位置传感器无通信、ECM与电子驻车控制模块通讯丢失等故障码。拆解发动机气门室缸盖罩发现机油乳化现象及三缸凸轮轴及三缸凸轮轴轴瓦异常磨损\n\n3.更换新的汽缸盖罩，机油控制阀及油水分离器后后恢复正常', '', '88100041520000', '', '688', '4875', '0', '5642', null, '43168.647512', '审核索赔单确认关联质量反馈单', '吉A81RC5', null, null, null, 'A', '43019', '43043.724514', '整理6', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
