INSERT INTO `mqms_voucher` VALUES ('1432', 'DGDD010MQI20190225011', 'DGDD010', '', '已确认', '43522.065683', 'DGDD010RO1902240007', 'C1440A', '', '', '', '', '', 'HR1A-0A5', 'H012383', 'AT', '7001', 'RA047VJ1011J5230XCU', 'HR1A-0A5-00-W1-R', '43520', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '1、车主前天到我站反映车辆发动机故障灯长亮，我们登记检查车辆。\r\n2、我站技师检查车辆读取故障码为：P003700后氧传感器加热器短路到低电压，P013600后氧传感器断路，检查其无磕碰现象。\r\n3、3、判断为：后氧传感器元件损坏导致亮故障灯，需更换新件。', '43521.740949', 'C', 'H', '诊断结果：1、车辆发动机故障灯长亮。\r\n2、我站技师检查车辆读取故障码为：P003700后氧传感器加热器短路到低电压，P013600后氧传感器断路，检查其无磕碰现象。\r\n3、更换氧传感器，故障排除。', '', '10130201520000', '', '16', '281', '0', '339', null, '43522.065683', '审核索赔单确认关联质量反馈单', '粤D3V668', null, null, null, 'A', '43271', '43322', '整理7', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
INSERT INTO `mqms_voucher` VALUES ('1433', 'DGDS020MQI20190524001', 'DGDS020', '', '已确认', '43610.067257', 'DGDS020RO1905220067', 'C1440A', '', '', '', '', '', 'FR2A-0A5', 'H030824', 'AT', '10226', 'FAP34VJ1016J906039Z', 'FR2A-0A5-00-W1-2', '43607', '10', '电气，进气和排气系统，暖风，空调，仪表', '1002', '电气—车身，排气', '100211', '故障灯点亮', '客户到店反映车辆发动机故障灯亮', '43609.691458', 'B', 'F', '1.经技师检测，电脑显示P01360后氧传感器短路（见故障码）\r\n2.检查氧传感器表面无明显破损。\r\n3.替换新的氧传感器试车，故障排除,确认为氧传感器内部故障需更换处理。\r\n4.更换氧传感器故障排除。', '', '10130201520000', '', '8', '281', '0', '331', null, '43610.067257', '审核索赔单确认关联质量反馈单', '桂JE5856', null, null, null, 'A', '43369', '43452', '整理7', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
