INSERT INTO `mqms_voucher` VALUES ('1451', 'DZJB040MQI20180718003', 'DZJB040', '', '已确认', '43311.649282', 'DZJB040RO1807100002', 'C1001A', '', '', '', '', '', 'HR1A-0A5', 'D070634', 'AT', '2170', 'RA047VJ1011J223140M', 'HR1A-0A5-00-W1-R', '43291', '01', '发动机', '0103', '噪音，振动', '010305', '卡搭声', '1.客户到店表示发动机有卡搭声，要求我店必须解决。\r\n2.经我店技师检查发动机确实存在卡搭声，经过我店的技术报告与主机厂老师的联系，主机厂同意更换发动机总成，我店与客户协商，客户同意更换发动机总成。', '43299.509549', 'B', 'H', '1.客户到店表示发动机有卡搭声，要求我店必须解决。\r\n2.经我店技师检查发动机确实存在卡搭声，经过我店的技术报告与主机厂老师的联系，主机厂同意更换发动机总成，我店与客户协商，客户同意更换发动机总成。\r\n3.更换发动机总成故障排除，客户表示满意。', '', '88100011520000', '', '640', '14013', '0', '15389', null, '43311.649282', '审核索赔单确认关联质量反馈单', '浙B68NH0', null, null, null, 'A', '43184', '43198', '整理7', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
