INSERT INTO `mqms_voucher` VALUES ('1453', 'DJXB010MQI20181019012', 'DJXB010', '', '已确认', '43393.066991', 'DJXB010RO1810140027', 'C3120A', '', '', '', '', '', 'HR1A-0A5', 'D064776', 'AT', '7222', 'RA047VJ1011J2190TS8', 'HR1A-0A5-00-W1-R', '43387', '01', '发动机', '0103', '噪音，振动', '010305', '卡搭声', '客户到店做首保，反映这段时间发动机很响。', '43392.637199', 'C', 'H', '1.经检查该车没有事故和人为拆装痕迹。\r\n2.检查发动机冷却液和机油液位正常\r\n3.启动发动机，加油门3千转5分钟，故障依旧\r\n4.判断发动机气门响。\r\n5.根据厂家技术老师指引更换液压挺柱总成。\r\n故保修更换液压挺柱总成。', '', '10060961310000', '', '840', '392', '0', '1291', null, '43393.066991', '审核索赔单确认关联质量反馈单', '赣BEH508', null, null, null, 'A', '43176', '43211', '整理7', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
