INSERT INTO `mqms_voucher` VALUES ('1514', 'DHNG010MQI20191117007', 'DHNG010', '', '已确认', '43787.066539', 'DHNG010RO1911140017', 'C1260A', '', '', '', '', '', 'HR1A-0M5', 'D044766', 'MT', '51514', '+EGE46000001J2070CJ9', 'HR1A-0M5-00-W1-R', '43783', '01', '发动机', '0103', '噪音，振动', '010302', '异响', '客户反映车辆在加速过程中发动机异响', '43786.702639', 'B', 'H', '1.客户反映车辆在加速过程中发动机异响\r\n2.技师试车发现，车辆加速至2000转以上时发动机前部异响明显\r\n3.技师拆掉外锲带，异响仍然有，确认异响部位是发动机前端内部异响。拆检前正时盖，发现正时张紧器柱塞磨损严重，活动导轨上链条摩擦痕迹明显，检测发动机机油压力正常。检查相关部位无碰撞及干涉，检查鉴定为正时张紧器张力不足导致的正时链条异响\r\n4.更换正时张紧器及链条导轨\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '', '10060831510000', '', '760', '173', '0', '958', null, '43787.066539', '审核索赔单确认关联质量反馈单', '湘GK6563', null, null, null, 'A', '43139', '43157', '整理9', null, null, '151', 'DCT', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, '');
